(1, 'Contact Us', 'contact-us', '<p>grosirieindia@gmail.com</p>', 0, 0, '2020-06-28 17:31:02'),
(2, 'About Us', 'about-us', '<p>Grosirie is the India\'s most safest online store, promising you the best offers on all your daily needs and groceries with some exceptional services to deliver your quality products with a privilege of an incomparable customer care. </p>\r\n\r\n<p>Home delivery services started in Home Town Warangal and to expand to different cities across India.</p>\r\n\r\n<p>Safety and Quality are our Top most priority. </p>\r\n<p>All our Employees and Delivery executives follow the extreme safety measures and makes sure the customer is satisfied with the service.</p>\r\n\r\n<p>Inspired from COVID-19 Lockdown situation which struck India in 2020.</p>\r\n\r\n<p><strong>Contact Us</strong></p>\r\n<p>9000805375</p>\r\n<p>Timings : 9:00AM to 1:00PM and 2:00PM to 5:00PM</p>\r\n<p>Office Details: H.No- 27-14-62 Opp Hasanparthy Police Station, Hanamkonda, Warangal, Telangana, India 506015</p>', 0, 0, '2020-07-11 08:15:07'),
(3, 'Terms of Use', 'terms-of-use', '<p><strong>Terms and Conditions</strong></p>\r\n<p><strong>Personal Information</strong></p> \r\n	GROSIRIE India is the licensed owner of the brand Grosirie. GROSIRIE India respects your privacy. This Privacy Policy provides succinctly the manner your data is collected and used by Grosirie on the application. As a visitor to the application/ Customer you are advised to please read the Privacy Policy carefully. By accessing the services provided by the Application you agree to the collection and use of your data by Grosirie India in the manner provided in this Privacy Policy.\r\n<p><strong>Services overview</strong></p>\r\nAs part of the registration process on the Application, GROSIRIE may collect the following personally identifiable information about you: Name including first and last name, alternate email address, mobile phone number and contact details, Postal code, Demographic profile (like your age, gender, occupation, education, address etc.).\r\n\r\n<p><strong>Eligibility</strong></p>\r\nServices of the Application would be available to only select geographies in India. Persons who are \"incompetent to contract\" within the meaning of the Indian Contract Act, 1872 including un-discharged insolvents etc. are not eligible to use the Application. If you are a minor i.e. under the age of 18 years but at least 13 years of age you may use the Application only under the supervision of a parent or legal guardian who agrees to be bound by these Terms of Use. If your age is below 18 years your parents or legal guardians can transact on behalf of you if they are registered users. You are prohibited from purchasing any material which is for adult consumption and the sale of which to minors is prohibited.\r\n\r\n<p><strong>License & Application access</strong></p>	\r\nGROSIRIE grants you a limited sub-license to access and make personal use of this application and not to download (other than page caching) or modify it, or any portion of it, except with express written consent of GROSIRIE. This license does not include any resale or commercial use of this application or its contents; any collection and use of any product listings, descriptions, or prices; any derivative use of this application or its contents; any downloading or copying of account information for the benefit of another merchant; or any use of data mining, robots, or similar data gathering and extraction tools. This application or any portion of this application may not be reproduced, duplicated, copied, sold, resold, visited, or otherwise exploited for any commercial purpose without express written consent of GROSIRIE. You may not frame or utilize framing techniques to enclose any trademark, logo, or other proprietary information (including images, text, page layout, or form) of the Application or of GROSIRIE and its affiliates without express written consent. You may not use any meta tags or any other \"hidden text\" utilizing the Application’s or GROSIRIE’s name or GROSIRIE name or trademarks without the express written consent of GROSIRIE. Any unauthorized use terminates the permission or license granted by GROSIRIE\r\n\r\n<p><strong>Account & Registration Obligations</strong></p>\r\nAll shoppers have to register and login for placing orders on the Application. You have to keep your account and registration details current and correct for communications related to your purchases from the application. By agreeing to the terms and conditions, the shopper agrees to receive promotional communication and newsletters upon registration. The customer can opt out either by unsubscribing by contacting the customer service. \r\n\r\n<p><strong>Pricing</strong></p>\r\nAll the products listed on the Application will be sold at MRP unless otherwise specified. The prices mentioned at the time of ordering will be the prices charged on the date of the delivery. Although prices of most of the products do not fluctuate on a daily basis but some of the commodities and fresh food prices do change on a daily basis. In case the prices are higher or lower on the date of delivery not additional charges will be collected or refunded as the case may be at the time of the delivery of the order.\r\n\r\n<p><strong>Cancellation by Application / Customer</strong></p>\r\n	We as a young start-up strive to provide you the best possible service. Due to the current situation of pandemic crises we deeply regret to inform you that we won’t accept any cancellation from the customer’s end, but we as a fast-growing organization try to add more flexibility as soon as possible.\r\n	However, an order can be cancelled at any point from application in case of any incorrect/fraudulent transaction. In such a case money paid would be refunded, it would be reflected with seven days.\r\n\r\n<p><strong>Return & Refunds</strong></p>\r\nWe as a young start-up always wish to provide our customers maximum flexibility, but due to the current situation of pandemic crises we deeply regret to inform you that we won’t accept any return after delivery.\r\nHowever, the customer can question at the time of delivery in case of any damaged/mismatched product, the product can be returned/replaced at the time of delivery, incase of return - refund of product price would be initiated, and would be reflected within seven days.\r\n\r\n<p><strong>You Agree and Confirm</strong></p>\r\n\r\n•	That in the event that a non-delivery occurs on account of a mistake by you (i.e. wrong name or address or any other wrong information) any extra cost incurred by GROSIRIE for redelivery shall be claimed from you.\r\n•	That you will use the services provided by the Application, its affiliates, consultants and contracted companies, for lawful purposes only and comply with all applicable laws and regulations while using and transacting on the Application.\r\n•	You will provide authentic and true information in all instances where such information is requested of you. GROSIRIE reserves the right to confirm and validate the information and other details provided by you at any point of time. If upon confirmation your details are found not to be true (wholly or partly), it has the right in its sole discretion to reject the registration and debar you from using the Services and / or other affiliated applications without prior intimation whatsoever.\r\n•	You authorise GROSIRIE to contact you for any transactional purposes related to your order/account.\r\n•	That you are accessing the services available on this Application and transacting at your sole risk and are using your best and prudent judgment before entering into any transaction through this Application.\r\n•	That the address at which delivery of the product ordered by you is to be made will be correct and proper in all respects.\r\n•	That before placing an order you will check the product description carefully. By placing an order for a product, you agree to be bound by the conditions of sale included in the item\'s description.\r\n\r\n<p><strong>You may not use the Application for any of the following purposes: </strong></p>\r\n\r\n•	Disseminating any unlawful, harassing, libellous, abusive, threatening, harmful, vulgar, obscene, or otherwise objectionable material.\r\n•	Transmitting material that encourages conduct that constitutes a criminal offence or results in civil liability or otherwise breaches any relevant laws, regulations or code of practice.\r\n•	Gaining unauthorized access to other computer systems.\r\n•	Interfering with any other person\'s use or enjoyment of the Application.\r\n•	Breaching any applicable laws;\r\n•	Interfering or disrupting networks or web applications connected to the Application.\r\n•	Making, transmitting or storing electronic copies of materials protected by copyright without the permission of the owner.\r\n\r\n<p><strong>Colours</strong></p>\r\nWe have made every effort to display the colours of our products that appear on the application as accurately as possible. However, as the actual colours you see will depend on your screen, we cannot guarantee that your screen’s display of any colour will be accurate.\r\n\r\n<p><strong>Modification of Terms & Conditions of Service</strong></p>\r\nGROSIRIE may at any time modify the Terms & Conditions of Use of the application without any prior notification to you. You can access the latest version of these Terms & Conditions at any given time on the Application. You should regularly review the Terms & Conditions on the Application. In the event the modified Terms & Conditions is not acceptable to you, you should discontinue using the Service. However, if you continue to use the Service you shall be deemed to have agreed to accept and abide by the modified Terms & Conditions of Use of this Application.\r\n\r\n<p><strong>Governing Law and Jurisdiction</strong></p>\r\nThis User Agreement shall be construed in accordance with the applicable laws of India. Any dispute or difference either in interpretation or otherwise, of any terms of this User Agreement between the parties hereto, the same shall be referred to an independent arbitrator who will be appointed by GROSIRIE and his decision shall be final and binding on the parties hereto. The above arbitration shall be in accordance with the Arbitration and Conciliation Act, 1996 as amended from time to time. The arbitration shall be held in Warangal only. \r\n\r\n<p><strong>Reviews, Feedback, Submissions</strong></p>\r\nAll reviews, comments, feedback, postcards, suggestions, ideas, and other submissions disclosed, submitted or offered to the Application on or by this Application or otherwise disclosed, submitted or offered in connection with your use of this Application (collectively, the \"Comments\") shall be and remain the property of GROSIRIE. Such disclosure, submission or offer of any Comments shall constitute an assignment to GROSIRIE of all worldwide rights, titles and interests in all copyrights and other intellectual properties in the Comments. Thus, GROSIRIE owns exclusively all such rights, titles and interests and shall not be limited in any way in its use, commercial or otherwise, of any Comments. GROSIRIE will be entitled to use, reproduce, disclose, modify, adapt, create derivative works from, publish, display and distribute any Comments you submit for any purpose whatsoever, without restriction and without compensating you in any way. GROSIRIE is and shall be under no obligation (1) to maintain any Comments in confidence; (2) to pay you any compensation for any Comments; or (3) to respond to any Comments. You agree that any Comments submitted by you to the Application will not violate this policy or any right of any third party, including copyright, trademark, privacy or other personal or proprietary right(s), and will not cause injury to any person or entity. You further agree that no Comments submitted by you to the application will be or contain libellous or otherwise unlawful, threatening, abusive or obscene material, or contain software viruses, political campaigning, commercial solicitation, chain letters, mass mailings or any form of \"spam\". GROSIRIE does not regularly review posted Comments, but does reserve the right (but not the obligation) to monitor and edit or remove any Comments submitted to the Application. You grant GROSIRIE the right to use the name that you submit in connection with any Comments. You agree not to use a false email address, impersonate any person or entity, or otherwise mislead as to the origin of any Comments you submit. You are and shall remain solely responsible for the content of any Comments you make and you agree to indemnify GROSIRIE and its affiliates for all claims resulting from any Comments you submit. GROSIRIE and its affiliates take no responsibility and assume no liability for any Comments submitted by you or any third party.\r\n\r\n\r\n<p><strong>Objectionable Material</strong></p>\r\nYou understand that by using this Application or any services provided on the Application, you may encounter Content that may be deemed by some to be offensive, indecent, or objectionable, which Content may or may not be identified as such. You agree to use the Application and any service at your sole risk and that to the fullest extent permitted under applicable law, GROSIRIE and its affiliates shall have no liability to you for Content that may be deemed offensive, indecent, or objectionable to you.\r\n\r\n<p><strong>Indemnity</strong></p>\r\nYou agree to defend, indemnify and hold harmless GROSIRIE, its employees, directors, officers, agents and their successors and assigns from and against any and all claims, liabilities, damages, losses, costs and expenses, including attorney\'s fees, caused by or arising out of claims based upon your actions or inactions, which may result in any loss or liability to  GROSIRIE or any third party including but not limited to breach of any warranties, representations or undertakings or in relation to the non-fulfilment of any of your obligations under this User Agreement or arising out of the your violation of any applicable laws, regulations including but not limited to Intellectual Property Rights, payment of statutory dues and taxes, claim of libel, defamation, violation of rights of privacy or publicity, loss of service by other subscribers and infringement of intellectual property or other rights. This clause shall survive the expiry or termination of this User Agreement.\r\n\r\n<p><strong>Termination</strong></p>\r\nThis User Agreement is effective unless and until terminated by either you or GROSIRIE. You may terminate this User Agreement at any time, provided that you discontinue any further use of this Application. GROSIRIE may terminate this User Agreement at any time and may do so immediately without notice, and accordingly deny you access to the Application, Such termination will be without any liability to GROSIRIE. Upon any termination of the User Agreement by either you or GROSIRIE, you must promptly destroy all materials downloaded or otherwise obtained from this Application, as well as all copies of such materials, whether made under the User Agreement or otherwise. GROSIRIE\'s right to any Comments shall survive any termination of this User Agreement. Any such termination of the User Agreement shall not cancel your obligation to pay for the product already ordered from the application or affect any liability that may have arisen under the User Agreement.', 0, 0, '2020-07-05 10:42:44');
