(389, 'Gold Drop Refined Sunflower Oil 1Ltr', 'Gold Drop Refined Sunflower Oil is generally used for deep boiling, cooking and many more. It is crystal clear oil which is healthy. It is extracted from good-grade matured sunflower seeds.', 'gold_drop_1L.jpg', 57, 33, 0, 1, 131, '111', 0, 0, 1, 'Litre', 0, '00', 0, 17, 910, 0, 0, ''),
(390, 'Freedom Refined Sunflower Oil 1Ltr', 'Freedom Refined Sunflower Oil is clear, light and low absorbing. It is wealthy Vitamins D, A & E which makes it superior for your child health. It is a blend of monounsaturated and polyunsaturated fats with low saturated fat levels.', 'FREEDOM_SUNFLOWER_OIL_1L.jpg', 57, 33, 0, 1, 114, '110', 0, 0, 1, 'Litre', 0, '00', 0, 21, 910, 0, 0, ''),
(391, 'Freedom Refined Rice Bran Oil 1Ltr', 'With goodness of 10000+ppm oryzanol.', 'Freedom-Rice-Bran-Oil-1-Ltr.jpg', 57, 34, 0, 1, 123, '117', 0, 0, 1, 'Litre', 0, '0', 0, 1, 910, 0, 0, ''),
(392, 'Saffola Gold - Pro Healthy Lifestyle Edible Oil 1Ltr', 'Saffola Gold, Pro Healthy Lifestyle Edible Oil, takes care of you and your family by bringing together the benefits of natural Antioxidant, MUFA, PUFA and Vitamins A and D, thus the power of blended cooking oil offers Improved nutritional profile, with Losorb technology which ensures 20% less oil absorption in your food, hence blended oils give you a convenient way of getting the better of two oils in one.', 'saffola_gold_1.jpg', 57, 35, 0, 1, 139, '139', 0, 0, 1, 'Litre', 0, '0', 0, 2, 910, 0, 0, ''),
(393, 'Durga Ghee 500ML', 'Durga Ghee is very healthy for our Body. It can be consumed for better digestion. Ghee is good source of energy and provides vitality to human body', 'Durga_Ghee_500ml.jpg', 57, 37, 0, 1, 325, '321', 0, 0, 500, 'ML', 0, '0', 0, 2, 455, 0, 0, ''),
(394, 'Dabur Honey 600g', 'According to a recent clinical study, people who consume Dabur honey with warm water every morning, showed significant improvement in stamina, digestion, cholesterol level & waist/hip size, hence maintaining a healthy lifestyle. Dabur Honey conforms strictly with all requirements of FSSAI and international norms for purity. For a healthy start to your day, you can have Dabur Honey with warm water daily to see visible results. Buy now.', 'Dabur_Honey_600g.jpg', 57, 38, 0, 1, 199, '189', 0, 0, 600, 'Grams', 0, '0', 0, 15, 600, 0, 0, ''),
(395, 'GI Premium Bengal Gram/ Senaga Pappu 500g', 'The grams are of best quality having bright yellow color and nutty texture. It was one of the earliest cultivated legumes. It is called Senaga Pappu in Telugu. It makes a great, healthy snack on the go because they are rich in fiber and protein, and low in fat and calories. It is one of the most essential pulses in India. It is used in preparing various varieties.', 'rsz_1gi_premium_bengal_gram_senaga_pappu.jpg', 56, 28, 0, 1, 70, '48', 0, 0, 500, 'Grams', 0, '0', 0, 10, 500, 0, 0, ''),
(396, 'GI Premium Bengal Gram/ Senaga Pappu 1Kg', 'The grams are of best quality having bright yellow color and nutty texture. It was one of the earliest cultivated legumes. It is called as Senaga pappu in Telugu. It makes a great, healthy snack on the go because they are rich in fiber and protein, and low in fat and calories. It is one of the most essential pulses in India. It is used in preparing various varieties.', 'rsz_1gi_premium_bengal_gram_senaga_pappu1.jpg', 56, 28, 0, 1, 130, '88', 0, 0, 1, 'KG', 0, '0', 0, 4, 1, 0, 0, ''),
(397, 'Cadbury Dairy Milk Chocolate', 'Cadbury Dairy Milk Chocolate is for those everyday moments of joy that you want to share with your near and dear ones with something sweet. Just one bite will take you into the world of warmth, happiness and spontaneous fun. Rich, smooth and creamy Classic Milk Chocolate which gives you more joy in every bite.', 'Cadbury-Dairy-Milk-Chocolate.jpg', 61, 61, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '0', 0, 99, 13, 0, 0, ''),
(398, 'Kitkat 3 Fingers - Chocolate Bars', 'Kit Kat is the perfect balance of wafer and chocolate in an iconic finger shape. Simply unwrap, break off a finger, snap it in two and savour the crispy wafer finger covered in deliciously smooth Choco layer.', 'kitkat_3_finger.jpg', 61, 61, 0, 1, 20, '20', 0, 0, 1, 'NOS', 0, '0', 0, 43, 28, 0, 0, ''),
(399, 'Britannia Good Day Butter Cookies, 75 g', 'The all-time favourite, the classic butterlicious flavour of Britannia Good Day cookies only get better with time. The goodness of rich butter melts in mouth effortlessly, giving a cookie that’s loved by everyone. These crumbly cookies are the best partner when you crave munchies between meals. What’s more? It packs in more Good Day Smiles for you Store them in an airtight container and keeps enjoying this yummy indulgence.', 'Britannia_good_day_butter_75gms.jpg', 61, 60, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '00', 0, 5, 75, 0, 0, ''),
