(449, 'Saffola Masala Oats - Veggie Twist, 500 g', 'Saffola Masala Oats has a burst of flavours and are made from 100% natural wholegrain oats along with real vegetables and the choicest of masalas. Eating Saffola Masala Oats as part of your daily routine is not just fantastically healthy and delicious, but also requires minimal effort for preparation; ready in 3 minutes. It satisfies the cravings for those savoury flavours as a breakfast cereal or during different times of the day.', 'Saffola_veggie_twist_500g.jpg', 60, 53, 0, 1, 190, '188', 0, 0, 1, 'NOS', 0, '00', 0, 2, 500, 0, 0, ''),
(450, 'Saffola Oats 1Kg with Free Saffola Oats 400g', 'Saffola Oats are made from 100% natural wholegrain oats, which give you fantastic health benefits. Eating Saffola Oats as part of your daily routine is not just fantastically healthy and delicious, but also requires minimal effort for preparation. It satisfies the cravings as a breakfast cereal or during different times of the day. It gets ready in just 3 minutes and is a convenient, tasty yet healthy any time meal.', 'Saffola_oats_1kg.jpg', 60, 53, 0, 1, 199, '195', 0, 0, 1, 'NOS', 0, '00', 0, 13, 1, 0, 0, ''),
(451, 'Bambino Macaroni - Elbows, 400 g Pouch', 'Bambino Macaroni Elbow is the delicious dry pastas made of hard wheat which is a wide dietary fibre, proteins with delectable taste. It is simple and fast to make and good to load your stomach. It is a great source of energy and high in carbohydrates. Macaronis are even rich in food aspects as they can be supportive in maintaining or lose weight. They don\'t guide to abdominal obesity. \r\nBambino macaroni elbows especially in the time of breakfast or in the evening snack time.', 'macroni-bambino_elbow.jpg', 60, 52, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '00', 0, 2, 400, 0, 0, ''),
(452, 'Great Value Aluminium Foil 72m', 'Great Value Aluminium foil. It is odourless and longer in length. It has a uniform thickness to retain freshness. 1 in every 3 homes uses an aluminium foil to wrap and cook food. Aluminium foils have become commonplace in our lives. These foils are of high quality and will keep food fresh for a long time.', 'Great_Valu_Aluminum_Foil_72m.jpg', 62, 65, 0, 1, 355, '353', 0, 0, 1, 'NOS', 0, '0', 0, 3, 800, 0, 0, ''),
(453, 'Bambino Macaroni Elbow, 875 g', 'Bambino Pasta is made with 100% fine quality Durum wheat. Very healthy since it has nil cholesterol, nil fat and a good source of Iron, Protein and fibre. You can prepare hot delicious penne pasta using Bambino Macaroni Penne Pasta in fairly lesser time. The perfect hollow centre of the pasta helps hold sauce and makes it more delicious.', 'macroni-bambino_elbow1.jpg', 60, 52, 0, 1, 100, '98', 0, 0, 1, 'NOS', 0, '00', 0, 13, 875, 0, 0, ''),
(454, 'Snickers Chocolate Bar 15g', 'Do not let hunger change you into a person youre not. Add some peanut power to your day with Snickers Chocolate Bar which are made with real peanuts and chocolate. This iconic candy satisfies your taste buds and helps you fuel up during a busy day. Packed with roasted peanuts, nougat, caramel and milk chocolate, Snickers handles your hunger, so you handle the things in life that arent related to hunger at all. Reach out for a Snickers hunger bar to tackle snack time at the office, in the car or at home, because youre not you when youre hungry. These fun and delicious Snickers chocolate bars can be carried along whenever you need to keep hunger at bay. From lunchtime treats to on-the-go snacks, Snickers are perfect for any situation.', 'snickers_bar_mrp_10.jpg', 61, 61, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '00', 0, 37, 100, 0, 0, ''),
(455, 'Ariel Matic Detergent Washing Powder - Front Load, 1 kg', 'New & Improved Ariel Matic gives you tough stain removal in just 1 wash. Especially designed to be used in front loading machines, Ariel Matic Front Load offers brilliant stain removal for full loads. It also provides deep down cleaning and long-lasting freshness. Formulated specifically for fully automatic washing machines, it generates the right amount of foam in the machine to deliver superior cleaning inside the machine itself, without damaging the machine due to excess foam. It requires just 1 scoop for normal loads, and 1. 5 scoops for heavy loads, providing performance along with value. Ariel Matics cutting edge technology provides impeccable cleaning for all your clothes, and removes tough stains like juice, chocolate, tomato and butter/ghee.', 'Ariel_Matic_FL_1kg.jpg', 62, 62, 0, 1, 230, '229', 0, 0, 1, 'NOS', 0, '00', 0, 2, 1, 0, 0, ''),
(456, 'Ariel Matic Detergent Washing Powder - Top Load, 1 kg', 'New & Improved Ariel Matic gives you tough stain removal in just 1 wash. Especially designed to be used in top loading machines, Ariel Matic Top Load offers brilliant stain removal for full loads. It also provides deep down cleaning and long-lasting freshness. Formulated specifically for fully automatic washing machines, it generates the right amount of foam in the machine to deliver superior cleaning inside the machine itself, without damaging the machine due to excess foam. It requires just 1. 5 scoops for normal loads, and 2 scoops for heavy loads, providing performance along with value. Ariel Matics cutting edge technology provides impeccable cleaning for all your clothes, and removes tough stains like juice, chocolate, tomato and butter/ghee.', 'Ariel_Matic_TL_1kg.jpg', 62, 62, 0, 1, 210, '209', 0, 0, 1, 'NOS', 0, '00', 0, 2, 1, 0, 0, ''),
(457, 'Karani Turmeric(Haldi) Powder - 200g', 'Our Haldi powder is the most sought after by housewives and all commercial establishments for its distinct pure golden yellow colour.\r\n\r\nIt is also significantly used in places of worship and is an integral part of prayer ceremonies.\r\n\r\nHaldi is meticulously procured from Warangal, Nizambad and Erode markets, then graded, polished in-house and finely ground to give best texture and endure longer shelf life.', 'Karani_haldi_powder_200g.png', 58, 40, 0, 1, 50, '50', 0, 0, 1, 'NOS', 0, '00', 0, 3, 200, 0, 0, ''),
(459, 'Britannia Marie Gold Biscuits, 1 Kg', 'Britannia Marie Gold Biscuits are a good choice. These are crunchy and light in weight by which they provide activeness to the body while working. Owing to the low calories, these biscuits are an ideal combination with tea.\r\n\r\nIngredients:\r\nWheat Flour (65%), Sugar, Edible Vegetable Oil (10.3%), Invert Syrup Milk Solids (1.1%), Raisin Agents [500(Ii), 503(Ii)], Salt, Emulsifiers [471, 481[I]), Dough Conditioner (223), Calcium Salt, Vitamins, Ferrous Salt And Potassium Iodate.', 'Marie_Gold_biscuits_1kg.jpg', 61, 57, 0, 1, 120, '120', 0, 0, 1, 'NOS', 0, '00', 0, 0, 1, 0, 0, ''),
(461, 'Close Up Everfresh+ Anti-Germ Gel Toothpaste - Red Hot 150g', 'Closeup Everfresh+ Gel Toothpaste now in Triple Fresh Formula harnesses the combined power of 3 components – Anti-bacterial mouthwash, Purifying Gel and Natural Extracts of Tea Tree and Eucalyptus to keep your mouth clean, protected and fresh. It is infused with Anti-bacterial mouthwash formula with active zinc that fights up to 99% of germs. So kiss goodbye to bad breath and say hello to longer-lasting fresh breath for up to 12 hours*. It\'s purifying gel cleans to the deepest corners of your mouth. It also contains natural extracts of tea tree and eucalyptus which leave you feeling refreshed. FDI – World Dental Federation recognizes that brushing twice daily with Closeup Everfresh+ Gel Toothpaste is beneficial to oral health. *Based on in- vivo study with regular use over 4 weeks.', 'Close_up_150g.jpg', 63, 67, 0, 1, 85, '85', 0, 0, 1, 'NOS', 0, '0', 0, 3, 150, 0, 0, ''),
(462, 'Fair & Lovely BB Cream 18g', 'The Fair and Lovely BB Cream is a fairness cream with a make-up finish. This expert product brings together the benefits of foundation & advanced multivitamin fairness cream. Its suitable for all Indian skin tones.Use it daily to hide dark spots and blemishes, and achieve a bright and fresh look every day. You can also apply it for special occasions in place of make-up. It is enriched with the goodness of multivitamins that work from within to give you treatment-like fairness.', 'fair-and-lovely-bb-cream-18g.jpg', 63, 71, 0, 1, 85, '85', 0, 0, 1, 'NOS', 0, '0', 0, 2, 18, 0, 0, ''),
(463, 'Fair & Lovely Ayurvedic Care+ Face Cream 50g', 'Get a natural glow instantly with NEW Fair & Lovely Ayurvedic Care+ Cream. Infused with 16 expert ayurvedic ingredients, Fair & Lovely Ayurvedic Care+ Cream gives you a natural glow everyday. \r\nThe 16 expert ingredients are known to give the following benefits: \r\n1. Ingredients like Manjistha, Kesar & Lotus helps clear marks and improve complexion.\r\n2. Lodhra, Khas & Neelotpal calms and soothes skin.\r\nMilk, Chandan & wheat germ oil clears uneven skin tone.\r\nFair & Lovely Ayurvedic Care+ cream is not just a cream, it’s your ayurvedic glow expert that gives your skin a natural glow. Best effects obtained on regular usage. Suitable for all skin types but not advised for application on broken or inflamed skin. ', 'Fair_Lovely_Ayurvedic_50g.jpg', 63, 71, 0, 1, 133, '133', 0, 0, 1, 'NOS', 0, '0', 0, 2, 50, 0, 0, ''),
(464, 'Fair & Lovely Advanced Multi Vitamin Face Cream 50g', 'Fair & Lovely Advanced Multivitamin is a face cream with the hero ingredient of multivitamins, which are understood to work from within to give skin a blemish-free glow along with a smooth and soft texture. Women today want more skin quality led benefits like a radiant glow, skin that is free from blemishes and imperfections. While this new aspiration of skin, has visible radiance, it is also strongly associated with the quality of the skin itself. Fair & Lovely offers its consumer a high definition glow – which comprises skin clarity, more radiance and skin that is free from imperfections. Infused with Multivitamins - Vitamin B3, C, E and B6 and Niacinamide, it brightens your skin, reduces inflammation and hyperpigmentation and smoothens overall skin texture.', 'Fair_Lovely_Advanced_Multi_Vitamin-High-Definition-Glow_50g.jpg', 63, 71, 0, 1, 102, '102', 0, 0, 1, 'NOS', 0, '0', 0, 1, 50, 0, 0, ''),
(465, 'Fair & Lovely Advanced Multi Vitamin Face Cream 80g', 'Fair & Lovely Advanced Multivitamin is a face cream with the hero ingredient of multivitamins, which are understood to work from within to give skin a blemish-free glow along with a smooth and soft texture. Women today want more skin quality led benefits like a radiant glow, skin that is free from blemishes and imperfections. While this new aspiration of skin, has visible radiance, it is also strongly associated with the quality of the skin itself. Fair & Lovely offers its consumer a high definition glow – which comprises skin clarity, more radiance and skin that is free from imperfections. Infused with Multivitamins - Vitamin B3, C, E and B6 and Niacinamide, it brightens your skin, reduces inflammation and hyperpigmentation and smoothens overall skin texture.', 'Fair_Lovely_Advanced_Multi_Vitamin-High-Definition-Glow_50g1.jpg', 63, 71, 0, 1, 155, '155', 0, 0, 1, 'NOS', 0, '0', 0, 8, 80, 0, 0, ''),
(466, 'Lakme Face Wash - Blush & Glow Strawberry Blast 50g', 'Use the Lakme Blush and Glow Blast Face Wash to give your skin a gorgeous kissed glow, every day. Formulated by Lakme Salon experts & enriched with the goodness of rich Strawberry extracts. The face wash has fruit anti-oxidants and beads that cleanse your skin washing away dirt and other impurities. For the best results. Follow this simple Blush & Glow regime every day for a fruit-kissed glow every day. The beautiful texture & fragrance will make you fall in love instantly.', 'Lakme-Blush--Glow-Strawberry-Blast-Face-Wash_50g.jpg', 63, 71, 0, 1, 105, '105', 0, 0, 1, 'NOS', 0, '0', 0, 2, 50, 0, 0, ''),
(467, 'Lakme 9 to 5 Complexion Care Face Cream - Beige Foundation 9g', 'Sometimes your skin may need instant makeup when you have a meeting coming up in five minutes. For situations like these, this 9 to 5 Complexion Care Cream – Beige from Lakme will come in handy for you. If you have fair to wheatish complexion, then the beige shade of this cream could be ideal for you.', 'Lakme_CC_CreamBiege_9g.jpg', 63, 71, 0, 1, 105, '105', 0, 0, 1, 'NOS', 0, '0', 0, 2, 9, 0, 0, ''),
(468, 'TRESemme Hair Fall Defence Shampoo, 185ml', 'The Tresemme Hair Fall Defense Shampoo helps reinforce your hair strength and prevents hair fall due to breakage. Enriched with advanced quality ingredients, the formula is scientifically constituted to give you longer, stronger, & manageable hair with every wash. It works best on damaged and breakage-prone hair.\r\n\r\nThis range has been carefully selected for its advanced formula. Driven by our salon heritage, we work with our stylists to deliver expert solutions from salon quality products without the salon price tag. Our salon-inspired products enriched with high-quality ingredients that help you experience that salon feeling, every day. ', 'Tresemme_defense_shampoo_185ml.jpg', 63, 70, 0, 1, 120, '120', 0, 0, 1, 'NOS', 0, '00', 0, 1, 185, 0, 0, ''),
(469, 'Lakme 9 to 5 Complexion Care Face Cream - Bronze Foundation 9g', 'With hectic working hours, you may not have enough time to get ready for a party after the office hours. That’s when this 9 to 5 Complexion Care Cream – Bronze from Lakme will come to your rescue. The bronze shade of this cream can be ideal for people with dusky complexion.', 'Lakme_CC_CreamBronze_9g.jpg', 63, 71, 0, 1, 105, '105', 0, 0, 1, 'NOS', 0, '0', 0, 2, 9, 0, 0, ''),
(470, 'Sunsilk Stunning Black Shine Shampoo, 650 ml', 'Sunsilk Stunning Black Shine Shampoo, for hair that shines as you do! Shiny hair gives you a boost of confidence! Time to Shine! This exclusive formula, with Amla Pearl Complex, revives your black hair, leaving your hair looking fuller^, beautifully moisturized and mesmerizingly shiny. So girls, go out and stay ready to shine any time with Sunsilk Stunning Black Shine! Buy Now!\r\n\r\nFor best results follow up with use of Sunsilk Stunning Black Shine conditioner. The conditioner comes with revolutionary conditioner technology for oh so manageable hair. Using a conditioner and using it correctly, can make a difference to hair. By conditioning your hair you are ensuring that it behaves just like you want it to, every time you style it. Sunsilk Stunning Black Shine Shampoo keeps your hair shine through the day^^. ^Based on lab test of volume with Sunsilk system vs. unclean hair ^Based on lab test on Sunsilk system vs. non-conditioning shampoo', 'Sunsilk_Black_Shine_Shampoo_650ml.jpg', 63, 70, 0, 1, 365, '365', 0, 0, 1, 'NOS', 0, '00', 0, 2, 650, 0, 0, ''),
(471, 'Sunsilk Stunning Black Shine Shampoo, 340 ml', 'Sunsilk Stunning Black Shine shampoo, for hair that shines like you do! Shiny hair gives you a boost of confidence! Sunsilk Stunning Black Shine shampoo is Co-created with Jamal Hammadi, Shine Expert from Hollywood. Jamal is a hairdresser to Hollywood stars and known for his natural approach to achieving healthy shine. Time to Shine! This exclusive formula, with Amla Pearl Complex, revives your black hair, leaving your hair looking fuller, beautifully moisturized and mesmerizingly shiny. So girls, go out and stay ready to shine any time with Sunsilk Stunning Black Shine! For best results follow up with use of Sunsilk Stunning Black Shine conditioner. The conditioner comes with revolutionary conditioner technology for more manageability than ever before. Using a conditioner and using it correctly, can make a difference to hair. By conditioning your hair you are ensuring that it behaves just like you want it to, every time you style it.', 'sunsilk_stunning_black_shine.jpg', 63, 70, 0, 1, 180, '180', 0, 0, 1, 'NOS', 0, '00', 0, 2, 340, 0, 0, ''),
(472, 'Sunsilk Lusciously Thick & Long Shampoo, 340 ml with FREE 180ml Sunsilk Black Shine Conditioner', 'Sunsilk Lusciously Thick & Long shampoo, for visibly thicker hair that bounces with you! Thick & long hair is every Indian girls dream. Sunsilk Lusciously Thick & Long shampoo is Co-created with Teddy Charles, Hair Style Expert. Teddy Charles embodies Big Hair. He has been creating fabulous looks since he was a teenager & has a world-class range of high profile partnerships. More bounce, more life! Sunsilk Lusciously Thick & Long shampoos exclusive formula, is enriched with Keratin Yoghurt & nutrients, makes your hair look fuller, with more body and more bounce. So you have your hair always on your side. So when your hair is visibly thick, take your own hairstyle pick. For best results follow up with use of Sunsilk Lusciously Thick & Long conditioner. The conditioner comes with revolutionary conditioner technology for more manageability than ever before. Using a conditioner and using it correctly, can make a difference to hair. By conditioning your hair you are ensuring that it behaves just like you want it to, every time you style it. Sunsilk Lusciously Thick & Long Shampoo gives you the freedom to style your hair the way you want. ', 'Sunsilk_Thick_Long_340ml.jpg', 63, 70, 0, 1, 180, '180', 0, 0, 1, 'NOS', 0, '00', 0, 1, 340, 0, 0, ''),
(473, 'Indulekha Hair Oil - Bhringa, 50 ml', 'Indulekha bringha oil is an ayurvedic proprietary medicine recommended for the regulation of hair and scalp conditions like hairfall, dandruff etc. The excellent action of Indulekha Bringha oil is due to the actions of its ingredients and the special manufacturing procedure of the base oil. During the production of Indulekha Bringha Oil, the Swethakutaja leaves are dipped in pure coconut milk oil (prepared by cold process technology). This prolonged blending process helps to extract the entire medicinal quality of the leaves and thus makes it an effective ingredient of Indulekha Bringha Oil.Active ingredients along with the base oil create an excellent combination that is extremely beneficial for hair. SvethakutajaIt has anti-inflammatory and anti-dandruff properties.', 'Indulekha_Hair_oil_50ml.jpg', 63, 70, 0, 1, 234, '232', 0, 0, 1, 'NOS', 0, '00', 0, 1, 50, 0, 0, ''),
(474, 'Indulekha Bhringa Hair Oil, 100 ml', 'Indulekha Bringha Oil is an Ayurvedic proprietary medicine recommended for the regulation of hair and scalp conditions like hairfall, dandruff etc. The excellent action of Indulekha Bringha oil is due to the actions of its Ingredients and the special manufacturing procedure of the base oil. During the production of Indulekha Bringha Oil, the Swethakutaja leaves are dipped in pure coconut milk oil (prepared by cold process technology). This prolonged blending process helps to extract the entire medicinal quality of the leaves and thus makes it an effective Ingredient of Indulekha Bringha Oil. Active Ingredients along with the base oil create an excellent combination that is extremely beneficial for hair.Svethakutaja It has anti-inflammatory and anti-dandruff properties.', 'Indulekha_Hair_oil_100ml.jpg', 63, 70, 0, 1, 432, '431', 0, 0, 1, 'NOS', 0, '00', 0, 1, 100, 0, 0, ''),
(475, 'Clinic Plus Strong & Long Health Shampoo, 340 ml with FREE Pond\'s Talc 50g', 'Clinic Plus believes that girls can achieve their true potential when they are raised to be strong. Mothers who empower their daughters by instilling values such as resilience and determination in them will find that the confidence to face life’s obstacles comes naturally to them. A solid foundation is always essential and empowering – both in life, and when it comes to hair as well. Hair can only grow when it is given the strength to do so. Which is why Clinic Plus shampoos are imbibed with ingredients that nourish girls’ hair and helps give it strength to keep growing. ', 'ClinicPlus_Shampoo_with_Ponds_talc_powder.jpg', 63, 70, 0, 1, 159, '158', 0, 0, 1, 'NOS', 0, '00', 0, 4, 340, 0, 0, '');
