(477, 'Wheel Detergent Powder - Green Lemon & Jasmine, 500 g', 'Active Wheel aims to bring delight into the lives of millions of women across the country by giving them a blissful laundry experience reminiscent of the fragrance of thousands of flowers.• Active Wheel, with the strength of lemons and its sweet fragrance, transforms this ordeal into a gratifying experience that lifts her spirits for the day to come.\r\n\r\nHow to Use:\r\nTake required amount of powder in while the washer is filling, but before adding the clothes.', 'Wheel_detergent_500g.jpg', 62, 62, 0, 1, 27, '27', 0, 0, 1, 'NOS', 0, '00', 0, 6, 500, 0, 0, ''),
(478, 'Wheel Detergent Powder - Green Lemon & Jasmine, 1 kg', 'Powered with the strength of lemons, Wheel Green Lemon & Jasmine Detergent Powder removes the toughest stains from your clothes instantly. The sweet fragrance ensures that you have a great laundry experience.', 'Wheel_detergent_1kg.jpg', 62, 62, 0, 1, 53, '53', 0, 0, 1, 'NOS', 0, '00', 0, 4, 1, 0, 0, ''),
(479, 'Vim Dishwash Active Gel - Lemon, 250 ml', 'Vim is a quality product from Hindustan Unilever Limited. Launched in 1993, Vim is the original hand dishwashing brand which created the whole category. Vim continues to lead the market and is the biggest player in the category. Vim was the first brand to introduce dishwasher gel in India and has been the leader in the segment since introduction with 7 out of 10 gel dishwasher consumers using Vim Gel. \r\nVim Gel, with the power of 100 lemons, gives you complete cleaning without leaving any residue, unlike Dishwash Bars. It is also great value for money with one spoon of Vim Gel being enough to clean a full sink of dirty utensils. Its superior fragrance leaves your utensils smelling fresh, while its pH neutral formula is gentle on your hands. It also keeps your expensive utensils like non-stick cookware looking new for longer as it cleans without scratching the surface and is recommended by Prestige and Nirlep for their range of non-stick cookware. \r\nFor cooking vessels, add a drop of Vim gel directly on the scrubber and wash to get rid of tough stains. For other utensils, tiffins and dishes, take a spoonful of Vim, mix it in a bowl of water use the mixture to wash. So go ahead and enjoy the Vim Gel experience.', 'Vim-Lemon-Dishwash-Gel-Bottle.png', 62, 63, 0, 1, 45, '45', 0, 0, 1, 'NOS', 0, '00', 0, 0, 250, 0, 0, ''),
(480, 'Surf Excel Quick Wash Detergent Powder, 500 g', 'Surf Excel Quick Wash detergent powder, a one-stop solution for all your laundry woes. While learning new skills and having fun, children often come home with a variety of stains on their clothes and more so often on their very important uniforms. While youre happy that they have these new experiences, the stains leave you worried. To fight these difficult stains you end up putting in a lot extra effort and use additional stain removers such as bleach, lemon etc. Its time you switch to this detergent powder and say goodbye to long laundry drills and juggling with different stain removal products each day. It is one of the premium most detergent powders available in India and has X-Tra Clean particles that combine the power of different stain removing products such as lemon and bleach. The superior technology of Surf Excel Quick Wash removes a variety of common tough stains like oil, ketchup, chocolate, curry stains, tea etc. With X-tra cleaning particles, it makes for the perfect wash.', 'SurfExcel_Quick_Wash_500g.jpg', 62, 62, 0, 1, 90, '89', 0, 0, 1, 'NOS', 0, '00', 0, 5, 500, 0, 0, ''),
(481, 'Surf Excel Quick Wash Detergent Powder, 1 kg', 'Surf Excel Quick Wash detergent powder, a one-stop solution for all your laundry woes. While learning new skills and having fun, children often come home with a variety of stains on their clothes and more so often on their very important uniforms. While youre happy that they have these new experiences, the stains leave you worried. To fight these difficult stains you end up putting in a lot extra effort and use additional stain removers such as bleach, lemon etc. Its time you switch to this detergent powder and say goodbye to long laundry drills and juggling with different stain removal products each day. It is one of the premium most detergent powders available in India and has X-Tra Clean particles that combine the power of different stain removing products such as lemon and bleach. The superior technology of Surf Excel Quick Wash removes a variety of common tough stains like oil, ketchup, chocolate, curry stains, tea etc. With X-tra cleaning particles, it makes for the perfect wash.', 'SurfExcel_Quick_Wash_1kg.jpg', 62, 62, 0, 1, 180, '179', 0, 0, 1, 'NOS', 0, '00', 0, 6, 1, 0, 0, ''),
(482, 'Surf Excel Liquid Detergent - Matic, Top Load, 1 L', 'Presenting new Surf Excel Matic Top Load Liquid - a revolutionary liquid detergent for top load washing machines. Surf Excel Matic Liquid is effective in high water level environment (40 liters) of top load washing machines and dissolves completely ensuring it leaves no residue in your machine or your clothes. New Surf excel matic liquid top load is specially made for washing machines and gives you tough stain removal in machines. Being liquid its best suited for washing machines and ensures a superior laundry experience and offers the following benefits: FASTER STAIN REMOVAL: New Surf Excel Matic liquid with a powerful cleaning technology penetrates stains faster and removes tough stains in machines itself EASY & BETTER DISSOLUTION: Being liquid it dissolves quickly in high water level environment of washing machines, reaches stains effortlessly and leaves no residue on clothes or in machines. ', 'surf_matic_liquid_top_load.jpg', 62, 62, 0, 1, 209, '208', 0, 0, 1, 'NOS', 0, '00', 0, 3, 1, 0, 0, ''),
(483, 'Surf Excel Liquid Detergent - Matic, Front Load, 1 L', 'Presenting new Surf Excel Matic Front Load Liquid - a revolutionary liquid detergent for front load washing machines. Surf Excel Matic Liquid is effective in high water level environment (20 liters) of front load washing machines and dissolves completely ensuring it leaves no residue in your machine or your clothes. New Surf excel matic liquid top load is specially made for washing machines and gives you tough stain removal in machines. Being liquid its best suited for washing machines and ensures a superior laundry experience and offers the following benefits: FASTER STAIN REMOVAL: New Surf Excel Matic liquid with a powerful cleaning technology penetrates stains faster and removes tough stains in machines itself EASY & BETTER DISSOLUTION: Being liquid it dissolves quickly in high water level environment of washing machines, reaches stains effortlessly and leaves no residue on clothes or in machines. ', 'SurfExcel_front_load_1L.jpg', 62, 62, 0, 1, 235, '234', 0, 0, 1, 'NOS', 0, '00', 0, 2, 1, 0, 0, ''),
(484, 'Surf Excel Liquid Detergent - Matic, Front Load, 500 ml', 'Presenting new Surf Excel Matic Front Load Liquid - a revolutionary liquid detergent for front load washing machines. Surf Excel Matic Liquid is effective in high water level environment (20 liters) of front load washing machines and dissolves completely ensuring it leaves no residue in your machine or your clothes. New Surf excel matic liquid top load is specially made for washing machines and gives you tough stain removal in machines. Being liquid its best suited for washing machines and ensures a superior laundry experience and offers the following benefits: FASTER STAIN REMOVAL: New Surf Excel Matic liquid with a powerful cleaning technology penetrates stains faster and removes tough stains in machines itself EASY & BETTER DISSOLUTION: Being liquid it dissolves quickly in high water level environment of washing machines, reaches stains effortlessly and leaves no residue on clothes or in machines. SUPERIOR FRAGRANCE: It ensures that your clothes not only look fresh but also smell fresh while being safe on your hands COLOUR CARE: It removes tough stains in machines but retains the original color of the fabric MACHINE CARE: Bring liquid it leaves no residue, causing no scaling and produces the right amount of foam Now remove tough stains in the machine in 3 easy steps:. Step1: Pour some liquid on the tough stain. Step2: Rub the stain with the revolutionary Stain Scrubber cap. Step3: Pour the remaining liquid in the machine The 7-layer deep penetration formula of Matic liquid works in partnership with the machine to give tough stain removal in the machine itself. Hurry up buy Surf Excel Matic Washing Machine Laundry Detergent Front Load 500 ml, right here! ', 'Surf-Excel-Matic-Liquid-Front-Load-500ml.png', 62, 62, 0, 1, 120, '120', 0, 0, 1, 'NOS', 0, '00', 0, 3, 500, 0, 0, ''),
