(491, 'Lux Soft Touch Soap Bar, 100 g', 'Would you like to feel beautiful and confident with every shower? Could a beauty soap be more and make every shower the perfect bathing experience? Transform your daily shower into an indulgent one that will make you feel special every day with fine fragrance skin treats from Lux. Indulge in the newest jewel from Lux- Soft touch. Enhanced with floral beauty oil to leave your skin smelling as fragrant as a flower even hours after your bath. Its moisturising lather makes for an indulgent bathing experience leaving you with petal soft skin while giving gentle yet ultimate cleansing. The LUX Perfumed Bath Collection of Beauty Bars blend rich lather and sophisticated fragrances, crafted by the worlds best perfumers that help women feel fabulous, every day. So let the pampering begin right away and treat your skin to the ultimate bathing experience, because you are so much more and you deserve so much more. Try now!', 'Lux_Soft_Touch_100g.jpg', 63, 68, 0, 1, 25, '25', 0, 0, 1, 'NOS', 0, '00', 0, 5, 100, 0, 0, ''),
(492, 'Dove Cream Beauty Bathing Bar Soap, 100 g Carton', 'Dove Cream Beauty Bar combines a gentle cleansing formula with Doves signature 1/4 moisturizing cream to give you softer, smoother and more glowing skin. The mild cleansers help your skin to retain its natural moisture rather than stripping it away. This Dove bar even helps to replenish nutrients that are lost during the cleansing process - where a regular soap bar might leave your skin feeling dry and tight, a Dove White Bar leaves it feeling soft and smooth.  Its not a soap - its a beauty bar Washing with regular soap can cause skin to feel dry, tight and irritated as some cleansing Ingredients strip skin of essential nutrients. What makes Dove different? Its gentle cleansers help your skin retain its natural moisture and its mild formula is kind to your skin. Dove is the No.1 Brand recommended by dermatologists in India. For best results, lather up your Dove Beauty Bar and massage the smooth, creamy lather over your face and body before rinsing thoroughly. For soft, smooth hands, you can also enjoy regular hand-washing throughout the day with your Dove bar. Soap may dry out your hands, but the classic moisturizing formula of Dove bars will leave skin softer, smoother and more glowing.', 'Dove_Beauty_Cream_Bar_100g.jpg', 63, 68, 0, 1, 45, '45', 0, 0, 1, 'NOS', 0, '00', 0, 12, 100, 0, 0, ''),
(493, 'Domex Toilet Cleaner - Active Green 500 ml', 'Looking to tackle the problem of malodour in the toilet? After all, who wouldnt want their toilets to smell clean and fresh? Maybe its time to stop blaming the flush, the drainage system or the exhaust fan in the toilet, and its time to change your toilet cleaner! The all new Domex Fresh & Clean is a premium toilet cleaner that leaves behind a refreshing aroma and delivers a long lasting fragrance, while also killing 99. 9% germs. The disinfectant has the ideal thickness that makes the fluid spread evenly, ensuring ease of use. It is innovative colour-changing technology changes the colour of the product from green to blue when it comes in contact with water, removing malodour causing germs and resulting in a fresh smelling toilet. Using the all new Domex Fresh & Clean will not only erase all the germs and stains from your toilet bowl, but will also keep your toilet smelling fresh for hours! ', 'Domex-Toilet-expert-500-ml.jpg', 62, 64, 0, 1, 72, '72', 0, 0, 1, 'NOS', 0, '00', 0, 3, 500, 0, 0, ''),
