(504, 'Ponds Pure White Anti Pollution Activated Charcoal Face Wash 100g', 'Pond\'s Pure White Deep Cleansing Face Wash with activated carbon removes pollution from deep within the skin to give you a pollution-free glow with every wash. India\'s No. 1 face wash with activated carbon to remove pollution offers you an effective way to get radiant and flawless skin. This face wash is infused with active ingredients to provide you cleanliness that goes beyond the realm of regular cleansers. It penetrates deep into your skin cells to remove clogged dirt, dust, and grime. It revitalises your skin to make it look smoother and younger. This face wash also removes the layers of dead skin cells, revealing fair looking skin underneath. You can use this face wash frequently as it\'s very gentle and won\'t leave your skin dry. Get better-looking skin with Pond\'s Pure White Deep Cleansing Face Wash, which has the technology of activated carbon that attracts deep-seated “black” dirt caused by impurities, oil, and makeup to reveal a pure white you. It is the first of its kind to be formulated with activated carbon, which works with “black attracts black”. Carbon when heated or “activated” becomes 8x porous; hence, increasing its ability to detoxify and gently exfoliate dead skin cells while retaining the needed moisture.buy this right away!', 'Ponds_Pure_white_100g.jpg', 63, 71, 0, 1, 190, '190', 0, 0, 1, 'NOS', 0, '0', 0, 1, 100, 0, 0, ''),
(505, 'Taj Mahal Tea, 500 g', '50 Glorious years of Excellence \r\n• When the history of Tea is written down, 1966 will be a celebrated Chapter. For in that year, Brooke Bond Taj Mahal Tea was born, with a promise - To foster excellence in each Cup. Fifty years on, we have not forgotten that promise. Ordinary teas usually provide either strength of just flavour. However, Only Brooke Bond Taj Mahal Tea contains the precious essence of the Finest fresh tea leaves, giving you the perfect balance of strength and flavor. A flavor, which can only be matched by the exquisite melodies composed by the maestros who have been our ambassadors over the decades.\r\n• Rigor in Selection and Blending\r\n• The tea from every tea estate has its own taste - because of its terroir, pluck and flush. How then do we turn it all into the unique Taj experience for our customers - year after year? Enter our master tasters and blenders, and their traditions, built over many years. It takes millions of tastings and years of experience to be a taste for Taj Mahal Tea. The brew is golden-orange in colour, has a rich taste and an uplifting aroma.\r\n• So go ahead, savour the flavour of this historic blend, and enjoy the perfect taste of this priceless cup of tea and exclaim- Wah Taj!', 'Taj_Mahal_tea_500g.jpg', 60, 84, 0, 1, 320, '320', 0, 0, 1, 'NOS', 0, '00', 0, 4, 500, 0, 0, ''),
