(511, 'Vaseline Healthy Bright Daily Brightening Body Lotion 400ml', 'Having healthy, glowing skin is a vital part of your overall health. Vaseline® believes that truly healthy skin starts with deep healing moisture. It\'s not something you get by masking problems or through quick fixes. Your body produces melanin in response to the pollutants and UV exposure which can lead to skin damage, darkening and uneven skin tone. Vaseline® Healthy Bright, our best skin Brightening lotion helps heal* dry damaged skin and that restores for naturally glowing skin in 2 weeks. With micro-droplets of Vaseline® Jelly, the lotion helps heal* skin. Along with Vitamin B3, that is known to inhibit the production and transfer of melanin, it brings back skin\'s healthy radiance. Triple sunscreens provide brightness protection by blocking UVA and UVB rays to protect your skin\'s brightness from future damage. Use every day to help heal* skin and make it look healthier and fairer. The result is a brightening lotion for a body that deeply moisturises to help heal* darkened, damaged skin, leaving it healthier and brighter. Healthy, naturally glowing skin in 2 weeks. Use twice a day for best results. Apply generously and massage till it gets absorbed. *Healing by moisturization of normal-dry skin. Action in the epidermal region and within the cosmetic domain.', 'Vaseline_pink_400ml.jpg', 63, 71, 0, 1, 345, '345', 0, 0, 1, 'NOS', 0, '0', 0, 1, 400, 0, 0, ''),
(512, 'Red Label Tea, 500 g Carton', 'Tea when drunk on its own, without milk and sugar, not only tastes great but contains virtually no calories. This means that tea is an excellent accompaniment to a healthy balanced diet and lifestyle.\r\nTea is hydrating and ranked as the second most ideal fluid choice for hydration after water. Hydration is essential in maintaining health and wellbeing.\r\nTea is a rich source of flavonoids in the diet. It has been shown that in tea drinking populations, tea provides a significant contribution to daily flavonoid intake. A positive association has been linked between regular tea consumption (2-3 cups of tea, without milk and sugar) and protection against cardiovascular disease. \r\nTea contains L-theanine and low levels of caffeine which together may have positive effects in helping individuals keeping alert.', 'Red_Label_tea_500g.jpg', 60, 84, 0, 1, 240, '240', 0, 0, 1, 'NOS', 0, '00', 0, 6, 500, 0, 0, ''),
(513, 'Red Label Tea, 250 g Carton', 'Brooke Bond Red Label is one of India’s largest selling packaged tea brands. Brooke Bond Red Label Tea is a blend CTC tea with best quality leaves; processed in the unique Brooke Bond Tea Excellence Centre.  Every cup of Red Label is brewed with the best-chosen tea leaves; that ensure your tea has strength, rich colour, and refreshing taste. We believe our tea has the taste of togetherness that gives that perfect taste, colour and irresistible aroma. Red Label is all about coming together over a warm cup of tea with everyone around. It is the “Swad Apnepan ka (Taste of Togetherness). Brooke Bond Red Label stands for inclusiveness and making the world a better place one cup at a time. Enjoy the great tasting range from Red Label Core and Red Label Natural Care; that has a mix of 5 Ayurvedic ingredients namely Tulsi, Ashwagandha, Mulethi, Ginger and Cardamom. Red Label Natural Care is clinically proven to enhance immunity and help you fall ill less often.', 'Red_Label_tea_250g.jpg', 60, 84, 0, 1, 120, '120', 0, 0, 1, 'NOS', 0, '00', 0, 12, 250, 0, 0, ''),
(514, 'Vaseline Intensive Care Aloe Fresh Body Lotion 400ml', 'Vaseline Intensive Care Aloe Soothe lotion helps rejuvenate the dry skin even in harsh summers. It is a light lotion, that absorbs fast for a non-greasy and non-sticky feel, to keep your skin soft, smooth and refreshing. It is best suited for the summers and is available in 100 ml, 200 ml, 300 ml packs. Incorporate the wonderful benefits of aloe in your skincare regime with Vaseline Intensive Care Aloe Soothe regularly to help your skin look good and feel healthier.', 'Vaseline_green_400ml.jpg', 63, 71, 0, 1, 325, '325', 0, 0, 1, 'NOS', 0, '0', 0, 1, 400, 0, 0, ''),
(515, 'Kissan Mixed Fruit Jam, 200 g', 'Kissan Mixed Fruit Jam is made with 100% real fruit Ingredients • Is easy to use and can be enjoyed on the go every morning • Enjoy it best with Bread, Roti, Paratha or Dosa for a wholesome breakfast • Turns boring breakfast into an empty plate • Spreads easily with a spoon or a knife • Carefully sealed in impermeable glass packaging to retain the best flavour and taste of product. All your favorite fruits come together in Kissan Mixed Fruit Jam. A medley of flavours from 8 fruits such as Banana, Papaya, Apple, Pear, Pineapple, Mango, Grape and Orange blended in to one lip smacking jam. Kissan jam is the best jam with the goodness of your favorite 8 fruits. Kissan Mixed Fruit Jam is best partnered with bread to provide yummy on the go breakfast for your kid every morning. Think of different ways to eat it in.', 'Kissan_Mixed_fruit_jam_200g.jpg', 60, 55, 0, 1, 65, '62', 0, 0, 1, 'NOS', 0, '00', 0, 5, 200, 0, 0, ''),
(516, '3 Roses Dust Tea 250g', '• Since 1869, Brooke Bond has brought you the perfect tasting tea experience with the best chosen leaves from Assam. Brooke Bond has launched 3 Roses, one of Indias most preferred tea brand today. Brooke Bond 3 Roses since then has changed the way people drink tea.\r\n• In earlier time, tea was consumed for refreshment or just as a habit. Brooke Bond 3 Roses introduced Indias Tea as the most favourite hot beverage promising you - A Perfect cup of tea. Brooke Bond 3 Roses talented expertise gives you rich colour, irresistible taste and correct strength by perfectly blending three different tea leafs. When the three come together it is just perfect! It is so tasty that one cup of tea will never be enough, because it has perfect Colour Taste and Strength.\r\n• The Perfect Brew for Healthy and Playful MischiefA cup of Brooke Bond 3 Roses Tea is not just tasty but also healthy. Every cup of 3 Roses Tea contains special tea Leafs with natural flavonoids that helps improve blood circulation which is good for your familys health. These healthy flavonoids give 3 roses tea its perfect colour taste and strength. Its full of health and full of life. Its unmatched taste ignites playful mischief in the relationship. Healthier brew with Refreshing taste. It is irresistibly good relationship brew!\r\nFeatures & Benefits - \r\n• A sip of Brooke Bond 3Roses tea spreads warmth, care and mischievous behavior in you\r\n• High quality blends of tea rich in Color Taste and Strength and rich in healthy flavonoids.\r\n• Brooke Bond 3 Roses which is Stronger than ever stands for Perfect CTS Brooke Bond 3 Roses provides you the best blended tea Processed in the unique Brooke Bond Tea Excellence Center.\r\n• Its good time to talk with your favorite cup of 3 Roses tea', '3_Roses_dust_250g.jpg', 60, 84, 0, 1, 155, '155', 0, 0, 1, 'NOS', 0, '0', 0, 12, 250, 0, 0, ''),
