(518, 'Kissan Mixed Fruit Jam, 100 g Box', 'All your favorite fruits come together in Kissan Mixed Fruit Jam. A medley of flavours from 8 fruits such as Banana, Papaya, Apple, Pear, Pineapple, Mango, Grape and Orange blended in to one lip smacking jam. Kissan jam is the best jam with the goodness of your favorite 8 fruits. Kissan Mixed Fruit Jam is best partnered with bread to provide yummy on the go breakfast for your kid every morning. Think of different ways to eat it in. Spread it on a crunchy cracker, roll it up in a chapatti, drink it stirred in milk or whip up a bread and Jam delight for your kids breakfast with an assortment of flavours. Started in 1934, Kissan is a popular brand in India. Kissan is more than just jams, ketchups and squashes. Its all about kids eating happily & growing up happily. Kissan Jams yummy and fruit based sweet spread keeps both, mothers & kids happy. The brands reassurance to mothers is that they can make breakfast times fun yet wholesome every morning with the Kissan range of fruit jams that are made with 100% real fruit ingredients! Remember craving something utterly sweet? This is your answer to that in a packed sweet spread bottle. ', 'Kissan_Mixed_fruit_jam_100g.jpg', 60, 55, 0, 1, 20, '18', 0, 0, 1, 'NOS', 0, '00', 0, 12, 100, 0, 0, ''),
(519, 'Brown & Polson Corn Flour 100g', 'Brown & Polson cornflour is gluten free and so finely milled it is naturally smoother than ordinary flour giving greater results when used in all your cooking. Use it as a thickening agent for your base or as a batter for frying. This cornflour is set to takes your recipes one level higher.', 'B_P_Corn_flour_100g.jpg', 56, 29, 0, 1, 25, '25', 0, 0, 1, 'NOS', 0, '0', 0, 5, 100, 0, 0, ''),
(520, 'Brown & Polson Custard Powder 100g', 'Brown and Polson is a famous and trusted brand throughout India for over thirty years. Brown & Polson Vanilla Custard Powder 100g is common in most households. It is made from salt and corn flour which you can mix with milk and sugar. Mostly, it is used as the base for several deserts. You can also use it with ice cream and fresh fruits.', 'B_P_Custard_Powder_100g.jpg', 60, 54, 0, 1, 35, '35', 0, 0, 1, 'NOS', 0, '0', 0, 6, 100, 0, 0, ''),
(522, 'Bru Instant Coffee 50g', 'BRU Instant Coffee was launched in 1968 and was Indias first coffee-chicory mix instant coffee. It is the perfect mix of 70% coffee and 30% chicory and is made from a fine blend of the choicest plantation and Robusta beans. These coffee beans are first roasted to perfection, then the new and enhanced process ensures that the fresh coffee aroma is preserved so that you get a rich coffee taste beyond compare. Bru Instant coffee can be used to make an aromatic cup of hot coffee as well as a refreshing glass of cold coffee. With Bru Instant, you can now discover a great coffee experience with your loved ones. \r\nABOUT BRU \r\nA part of Hindustan Unilever Ltd. , BRU Coffee is Indias largest and favourite coffee brand that offers a wide variety of coffee products. Since 1968, BRU has been a pioneer in bringing the authentic taste of coffee to Indian consumers. The best coffee beans are selected from across innumerable coffee trails and are freshly roasted, to serve a great cup of rich, irresistible coffee. BRU has four distinct offerings - BRU Instant and BRU Gold in Instant coffee, BRU Green Label and BRU Select in Filter coffee. BRU-ed with love and blended with passion, BRU Coffee celebrates authenticity in coffee and relationships.', 'Bru_50g.jpg', 60, 84, 0, 1, 70, '70', 0, 0, 1, 'NOS', 0, '0', 0, 7, 50, 0, 0, '');
