(540, 'GI Premium Raisins/Kismis 100g', 'Indian Raisins are obtained by drying grapes in the sun or in mechanical driers, which turns fresh grapes into brown coloured raisins. Raisins come with loads of health benefits; however, they are rich in calories & sugars. It is a fine source of the B-complex vitamins B3, B2, B1, B6, and contain tiny amounts of Vitamin C, E & K. It is a dense supply of minerals like calcium, iron, manganese, potassium, magnesium copper, zinc, fluoride and boron.', 'rsz_gi_premium_raisins_kishmish.jpg', 56, 32, 0, 1, 60, '43', 0, 0, 100, 'Grams', 0, '0', 0, 3, 100, 0, 0, ''),
