(547, 'GI Premium Tamarind / Chintapandu 500g', 'This tamarind fruit pulp is sweetish and adds a sharp flavour to dishes. It is used for making chutneys, curries, sauces and soups. Pulp is a carminative and laxative given as combination in biliousness and flushed conditions. As its anti-scorbutic properties, the pulp is used by sailors in place of lime or lemon juice. ', 'rsz_gi_premium_tamarind.jpg', 58, 39, 0, 1, 190, '140', 0, 0, 500, 'Grams', 0, '0', 0, 5, 500, 0, 0, ''),
