(550, 'Exo Dishwash - Round, 500 g', 'Exo Dish Shine Bar is yet another offering that draws on the wealth of experience from the R & D division of Jyothi laboratories. This product not only cleans your utensils, but also protects them from bacteria and harmful germs. It is fortified with powerful anti-bacterial agents and kills disease-causing bacteria that enter your food through the contamination of vessels. The powerful formula removes sticky oil stains, grime, and stubborn burnt food residues from utensils and makes them safe and sparkling. You no longer have to spend hours in your kitchen washing utensils! The fast action formula with the hyper-cleaning technology quickly removes the toughest of stains and makes your vessels shine like never before. Exo Dish Shine Bar works hard on stains and grease, keeping your utensils shining and fresh. Exo Dish Shine Bar contains many anti-microbial agents that keep your vessels away from dirt and microbes. This dish wash bar is made in such a way that it does not create itching or pealing of your skin. It is skin-friendly and is composed of hyper-cleaning technology. Exo Dish Shine Bar makes your vessels fragrant and removes stain. This dish washing bar does not leave traces on the vessel and hence it can be easily washed.', 'exo_500g_resized.jpg', 62, 63, 0, 1, 48, '48', 0, 0, 1, 'NOS', 0, '00', 0, 32, 500, 0, 0, ''),
(551, 'Pril Dishwash Liquid - Active 2X Lime, 425 ml', 'It\'s Powerful Active 2x Molecules, Cut away Tough Grease Residue, Remove Food Smell, Leave Utensils Sparkling Clean', 'Pril_liquid_425ml.jpg', 62, 63, 0, 1, 98, '98', 0, 0, 1, 'NOS', 0, '00', 0, 10, 425, 0, 0, ''),
