(648, 'DAMAN Pink Salt, 1KG', 'DAMA Pink Rock Salt has high quantities of phosphorous, calcium, potassium, iron, magnesium, zinc, selenium, copper, bromine, zirconium and iodine. Use it in your daily food. DAMA Pink Rock Salt is rich in mineral content and has several health benefits. They are a healthier alternative to table salt.', 'Daman_Pink_Salt.jpg', 56, 31, 0, 1, 155, '155', 0, 0, 1, 'NOS', 0, '00', 0, 3, 500, 0, 0, ''),
(649, 'DAMAN Rock Salt, 1KG', 'Rock Salt brings a refreshing combination of great taste and health to your table.\r\n\r\nBenefits:\r\nRegulating the water content in your body. Promoting a healthy pH balance in your cells, particularly your brain cells. Promoting blood sugar health and helping to reduce the signs of aging. Assisting in the generation of hydroelectric energy in cells in your body. Absorption of food particles through your intestinal tract. Supporting respiratory health. Promoting sinus health. Prevention of muscle cramps. Promoting bone strength. Regulating your sleep -- it naturally promotes sleep. Supporting your libido. Promoting vascular health. In conjunction with water it is actually essential for the regulation of your blood pressure.', 'Daman_Rock_SAlt.jpg', 56, 31, 0, 1, 130, '130', 0, 0, 1, 'NOS', 0, '00', 0, 3, 500, 0, 0, ''),
(651, 'Bambino Vermicelli, 1kg', 'Bambino Vermicelli is an effortless, healthy and wholesome breakfast recipe. It is simple on the stomach, high in fibre and low in calories. It is non-sticky and doesn\'t form clumps. It is very delicious snacks in the nightfall.', 'bambino_vermicelli.jpg', 60, 52, 0, 1, 85, '83', 0, 0, 1, 'NOS', 0, '0', 0, 17, 1, 0, 0, ''),
(652, 'Aashirvaad Atta Superior 1kg', 'Aashirvaad Whole Wheat Flour is finished from the best accepted ingredients that help recover digestion and offer good number of well nutrients to the body. Aashirvaad Whole Grain Atta does not hold any extra preservatives or flavours. 100% full Wheat Chapati Flour and no Maida added. ', 'aashirvaad_atta_1kg.jpg', 56, 29, 0, 1, 57, '54', 0, 0, 1, 'NOS', 0, '0', 0, 16, 1, 0, 0, ''),
