(654, 'Aashirvaad Turmeric Powder 100g', 'Aashirvaad Turmeric Powder is well-known for its bright yellow color and used as a coloring agent Turmeric is used extensively in Indian dishes. Turmeric has also originated application in canned beverages, dairy products, baked products, yogurt, ice cream, and biscuits.', 'aashirvaad_turmeric_100g.jpg', 58, 40, 0, 1, 28, '28', 0, 0, 1, 'NOS', 0, '0', 0, 11, 100, 0, 0, ''),
(655, 'Savlon Deep Clean Pouch, Moisture Protection Hand Wash 725ml', 'Our hands are hotbeds of germs. Maintaining good hand hygiene is important for staying healthy. Keep your family in safe hands with Savlon’s advanced range of Handwashes. Savlon Handwash provides effective cleansing and protects you and your family from a million germs. Savlon Handwash also protects against the H1N1, Stomach Flu.  \r\n\r\nIt is dermatologically tested and is suitable for all skin types. Washing your hands is easy, and it’s one of the most effective ways to prevent the spread of germs. Keep yourself and your loved ones healthy by washing your hands often, especially during these key times when you are likely to get and spread germs - Before, during, and after preparing food, Before and after eating food, after using the toilet and after blowing your nose, coughing, or sneezing.  \r\n\r\nBreak the chain of infection with Savlon Handwash that protects from a million germs \r\nAlso, Protects from the H1N1, Stomach Flu.  \r\nSavlon Moisture Shield Handwash leaves you with soft, supple and clean hands, Gentle cleansing coupled with moisturizing benefit.\r\nDermatologically tested, suitable for all skin types, with natural extracts. No TCC. No Triclosan. No Added Parabens.', 'savlon_deep_clean_moisture_shield_refill_pouch.jpg', 63, 68, 0, 1, 99, '97', 0, 0, 1, 'NOS', 0, '0', 0, 2, 725, 0, 0, ''),
(656, 'Savlon Deep Clean Pouch, Herbal Protection Hand Wash 725ml', 'Our hands are hotbeds of germs. Maintaining good hand hygiene is important for staying healthy. Keep your family in safe hands with Savlon’s advanced range of Handwashes. Savlon Handwash provides effective cleansing and protects you and your family from a million germs. Savlon Handwash also protects against the H1N1, Stomach Flu.  \r\n\r\nIt is dermatologically tested and is suitable for all skin types. Washing your hands is easy, and it’s one of the most effective ways to prevent the spread of germs. Keep yourself and your loved ones healthy by washing your hands often, especially during these key times when you are likely to get and spread germs - Before, during, and after preparing food, Before and after eating food, after using the toilet and after blowing your nose, coughing, or sneezing.  \r\n\r\nBreak the chain of infection with Savlon Handwash that protects from a million germs \r\nAlso, Protects from the H1N1, Stomach Flu.  \r\nSavlon Moisture Shield Handwash leaves you with soft, supple and clean hands, Gentle cleansing coupled with moisturizing benefit.\r\nDermatologically tested, suitable for all skin types, with natural extracts. No TCC. No Triclosan. No Added Parabens.', 'savlon_deep_clean_refill_pouch.jpg', 63, 68, 0, 1, 99, '97', 0, 0, 1, 'NOS', 0, '0', 0, 2, 725, 0, 0, ''),
(659, 'GI Premium Black Eyed Seeds/ White Bobbarlu 1kg', 'Lobia White is an extremely delicious, nutritious and protein packed dish. These are high in fiber, folate, protein, complex carbohydrates, soluble fiber and iron. They are well known for their consistency and their ability to absorb flavors. High in fiber, white lobia also contain necessary vitamins and minerals. ', 'rsz_gi_premium_black_eyed_seeds_alasandhalu2.jpg', 56, 28, 0, 1, 150, '120', 0, 0, 1, 'KG', 0, '0', 0, 4, 1, 0, 0, ''),
(661, 'Margo Soap - 100 g (Buy 4 Get 1 Free)', 'Neem, a natural source of therapeutic benefits, has been scientifically proven to be amazingly effective for skin care. Margo Original Neem is made from 100% Original Neem through a unique procedure ensuring the therapeutic benefits of Neem are retained. It is infused with Vitamin E for added moisturising. Its anti-bacterial action deep cleanses and protects your skin, giving it the care it deserves. With a combination of medicinal & beauty benefits along with the goodness of 1000 Neem leaves, Margo Original Neem is a healer & cosmetician, with moisturising properties, without any side effects. * 98 Years unmatched heritage and authentic soap * Made from pure original neem * Added vitamin e and moisturizers for extra moisturizing', 'Margo_100_g_buy_4_get_1_free_1_300x3001.jpg', 63, 68, 0, 1, 120, '120', 0, 0, 1, 'NOS', 0, '00', 0, 3, 100, 0, 0, ''),
(662, 'Weikfield Baking Powder 100g', 'Baking powder is a dry chemical leavening agent, a mixture of a carbonate or bicarbonate and a weak acid. The base and acid are prevented from reacting prematurely by the inclusion of a buffer such as cornstarch. Baking powder is used to increase the volume and lighten the texture of baked goods.', 'weikfield_baking_powder.jpg', 59, 85, 0, 1, 30, '30', 0, 0, 100, 'Grams', 0, '0', 0, 3, 100, 0, 0, '');
