(663, 'Khadi Soap - Sandal and Honey, 125g', 'Khadi Sandal & Honey soap keeps the skin hydrated and moist. It has sandalwood oil which is known to have a calming effect on the body and mind and is cooling and relaxant used for all skin types. Honey is a natural cleanser and softener thus provides natural moisture to skin INGREDIENTS: Coconut Oil, Rice Bran Oil, Palm oil, Kokum Butter (Butter), Glycerine, Almond Oil, Wheat Germ Oil, Sheabutter (BUtter), Olive Oil, Caster oil, Water, Lye (Caustic Soda), Sandalwood Extract, Fragrance, Turmeric.', 'Khadi_Sandal_and_Honey_Soap_400x400.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 12, 125, 0, 0, ''),
(664, 'Khadi Soap - Almond, 125g', 'Khadi Almond Soap is filled with Vitamin E which helps to keep the skin soft and supple. It protects the skin cells from UV radiation and makes it healthy and radiant. It makes the skin to look smooth, soft and free of lines. Fatty acids present in almond extracts helps to keep the skin moist and nourished. This soap also helps reduce signs of ageing.', 'Khadi_Almond_Soap1_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 10, 125, 0, 0, ''),
(665, 'Khadi Soap - Neem & Tulsi, 125g', 'Khadi Neem-Tulsi Soap is rich in antibacterial and antifungal properties. This soap helps in keeping the skin soft an supple, thus protects from external bacteria. It treats acne and skin infections naturally. This soap helps in reducing the fine line and also well nourishes the soap. It keeps the skin hydrated and intact.', 'Khadi_Neem_Tulsi_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 12, 125, 0, 0, ''),
(666, 'Khadi Soap - Chandan Haldi, 125g', 'Khadi Chandan Haldi Soap is rich anti-bacterial and anti-fungal properties It is used for acne and acts as a natural agent for skin in providing Vitamin E. This soap helps in moisturizing and revitalizing the skin. It helps in restoring the natural skin glow. The anti-inflammatory qualities can target your pores and calm the skin. Turmeric is also known to reduce scarring.', 'Khadi_Chandan_Haldi_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 12, 125, 0, 0, ''),
(667, 'Khadi Soap - Lemongrass, 125g', 'Khadi Lemongrass Soap is filled with anti-microbial and anti-bacterial properties. It helps to limit bacterial or microbial growth on the skin, It also helps to minimize pores, limit the secretions of oil and provide a temporary skin-firming treatment. The anti-inflammatory properties of lemongrass oil can even ease skin irritation.', 'Khadi_lemongrass_soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 13, 125, 0, 0, ''),
(668, 'Kamal Brand Baking Powder 100g', 'Baking powder is a dry chemical leavening agent, a mixture of a carbonate or bicarbonate and a weak acid. The base and acid are prevented from reacting prematurely by the inclusion of a buffer such as cornstarch. Baking powder is used to increase the volume and lighten the texture of baked goods.', 'DSC_0143.jpg', 59, 85, 0, 1, 45, '45', 0, 0, 100, 'Grams', 0, '0', 0, 4, 100, 0, 0, ''),
(669, 'Khadi Soap - Aloe Vera, 125g', 'Khadi Aloe Vera soap is the best moisturiser for skin thus keeping the skin soft and supple. It maintains the natural oil of the skin. This soap helps to maintain the natural pH balance of the skin. It is rich in antibacterial properties thus keeping the skin healthy and glowing. Regular use of this khadi soap is a natural way of rejuvenating and keeping your skin soft and beautiful.', 'Khadi_Aloe_Vera_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 12, 125, 0, 0, ''),
(670, 'Khadi Soap - Lavender, 125g', 'Khadi Lavender soap is infused with an aromatic fragrance that helps in distressing the mind body and soul. This soap helps in the treatment of acne and skin infections. Cleanses the skin and body dirt while exfoliating dead cells from the body and give a soft & smooth feeling. It has a fresh and floral scent thus clams the body. It helps in maintaining the natural moisturiser of the skin.', 'Khadi_Lavender_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 11, 125, 0, 0, ''),
(671, 'Khadi Soap - Orange, 125g', 'Khadi Orange Soap is rich in citric content which aids in skin exfoliation and helps to dry out acne. Its rich in Vitamin C thus provides deep cleansing to the skin It is gentle, mildly exfoliating and very refreshing. Non-oily, non-detergent formula is safe and effective for all skin types to remove make-up and build-up from the skin’s surface without drying. It is exclusively formulated for pimples.', 'Khadi_Orange_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 13, 125, 0, 0, ''),
(672, 'Snapin Oregano 20g', 'Native to the Mediterranean region, Oregano is one of the most widely used herbs in the world. It has derived its name from a Greek word which means mountain-delight. Romans & many Europeans learned the use of Oregano from Greeks and started using it in various foods and medicines.', 'oregano.jpg', 58, 41, 0, 1, 79, '79', 0, 0, 20, 'Grams', 0, '0', 0, 22, 20, 0, 0, ''),
(673, 'Khadi Soap - Saffron, 125g', 'Khadi Saffron Soap has exfoliating properties that help in eliminating dead skin cells. The natural ingredients in this soap help in lightening the blemishes and scars. Its antioxidant properties help in making the skin glow and radiant. This soap makes the skin soft and supple.', 'Khadi_Saffron_Soap1.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 12, 125, 0, 0, ''),
(674, 'Khadi Soap - Basil Scrub, 125g', 'Khadi Basil Scrub Soap is a combination of carefully chosen mild soap base along with extracts of Basil for providing cleanliness and protection to gentle skin. This soap is widely used in skin care is as a cleanser since it has such a powerful action. This makes it perfect for those who suffer from oily skin or clogged pores, as it helps to remove dirt and impurities.', 'Khadi_BAsic_Scrub_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 1, 125, 0, 0, ''),
(675, 'Khadi Soap - Neem, 125g', 'Khadi Neem Soap is rich in antibacterial and antifungal properties. The soap is filled with natural ingredients thus keeps the skin healthy and glowing. It soothes and moisturises the skin. It protects skin from bacteria and cleanses thoroughly from dirt and pollution.', 'Khadi_Neem_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 1, 125, 0, 0, ''),
(676, 'Khadi Soap - Lemon, 125g', 'Khadi Lemon Soap is rich in Vitamin C and antioxidants which keeps the skin toned and even. This soap is used as a skin astringent as it helps in closing the pores. The scent is very subtle and natural. On regular usage, it tightens the skins and makes it smooth.', 'Khadi_Lemon_Soap_300x300.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '00', 0, 1, 125, 0, 0, ''),
(677, 'Khadi Soap - Charcoal, 100g', 'Khadi Charcoal soap is antibacterial and detoxifying, it helps in thorough cleaning of the skin maintaining the natural pH of the skin. It helps in refreshing and rejuvenating the skin and mind with its peaceful aroma. It has antifungal properties that protect the skin from bacteria. Soothes skin of irritation from bug bites, acne, eczema, and psoriasis. Lightens and diminishes the appearance of scars and blemishes.', 'Khadi_Charcoal_Soap1.jpg', 63, 68, 0, 1, 99, '95', 0, 0, 1, 'NOS', 0, '00', 0, 10, 100, 0, 0, ''),
(678, 'Flying Bird Strawberry Essence 20ml', 'Strawberry essence is a highly concentrated flavour extracted from fresh strawberries onto an alcohol base or synthesised artificially using chemical compounds. It is a pale straw coloured liquid with the aroma of fresh strawberry puree.', 'flying_bird_strawberry_essence.jpg', 59, 85, 0, 1, 30, '30', 0, 0, 20, 'ml', 0, '0', 0, 9, 20, 0, 0, ''),
(680, 'Eagle Ice Cream Mix 110g', 'Ice Cream Mixes are sweetened dairy mixtures used to make traditional churned or soft-serve ice cream or frozen yogurt. The ice cream mixes are used on-site to produce packaged ice cream and ice cream desserts, or sold as a mixture to be frozen and dispensed at restaurants and shops as frozen desserts.\r\n', 'Ice-Cream-Mix.jpg', 59, 85, 0, 1, 50, '50', 0, 0, 110, 'Grams', 0, '0', 0, 4, 110, 0, 0, ''),
(681, 'Veeba Chocolate Fudge Topping 380g', 'Veeba Chocolate Fudge Topping is made with real cocoa. It\'s a combination of real cocoa and milk solids. Use this delicious topping for milkshakes, hot chocolate, ice-creams, waffles, smoothies and more. So enjoy your dessert with Veeba and share it with everyone!', 'vebba_chocolate_toppings.jpg', 59, 85, 0, 1, 149, '149', 0, 0, 380, 'Grams', 0, '0', 0, 1, 380, 0, 0, ''),
(684, 'MRV Manchi Non Fruit Vinegar 200ml', 'The Vinegar We Usually Get In India Is Simply Water Added To Glacial Acetic Acid. White Wine Vinegar Is - Surprise! Made From White Wine Which Is Not Acetic Acid.', '', 60, 56, 0, 1, 25, '25', 0, 0, 200, 'ml', 0, '0', 0, 5, 200, 0, 0, ''),
(685, 'Ching\'s Secret Chilli Sauce 680g', 'Sound the gong for the Chinese Chef! It is now no secret that Chings Secret has the best range of Chinese cooking products that help you recreate the magic of your favourite Chinese restaurant and cook up a few signature dishes for parties and guests! Chings Chilly Sauce is one of the products from this range.', 'chings_chilli_sauce.jpg', 60, 54, 0, 1, 85, '84', 0, 0, 680, 'Grams', 0, '0', 0, 1, 680, 0, 0, ''),
