(687, 'Ching\'s Secret Dark Soy Sauce 750g', 'Chings Dark Soy Sauce preferred by using a traditional Chinese recipe. Soy beans, salt, sugar fermented to the excellence till the sauce is extracted.', 'chings_dark_soy_sauce.jpg', 60, 54, 0, 1, 85, '84', 0, 0, 750, 'Grams', 0, '0', 0, 2, 750, 0, 0, ''),
(688, 'Kissan Fresh Tomato Ketchup 1kg', 'This ones definitely a winner when it comes to cajoling your kids into eating their food. Its remarkable flavour comes from the 100% real juicy tomatoes that have gone in making it. Its an assured hero for all the snacks, be it samosas, pakodas, noodles or plain roti roll - a perfect ally for making wholesome and yummy food. Spread it on a crunchy cracker, roll it up in a roti roll, pour it on a samosa or noodles for your kids tiffin time with an assortment of flavours. So the next time you want to make those greens in your kids plate tolerable, turn to Kissan Tomato Ketchup, secret to empty tiffins!! Started in 1934, Kissan is a popular brand in India.', 'kissan_tomato_ketchup_1kg.jpg', 60, 54, 0, 1, 150, '148', 0, 0, 1, 'KG', 0, '0', 0, 2, 1, 0, 0, ''),
(691, 'Knorr Tomato Chatpata Cup-a-Soup 14g', 'Knorr Tomato Chatpata Cup-A-Soup is the perfect combination of tomato with sour, sweet, salty, and spicy flavours making this cup-a-soup an instant hit. Knorr Tomato Chatpata Cup-A-Soup satisfies your small hunger pangs in just 1 minute. Its crunchy, delicious and easy to make every time. Made with 100% real vegetables and no added preservatives, this soup is ready in three simple steps. So now enjoy Restaurant like delicious Soup at home.Knorr Soups range comprises of 11 delicious flavours of 4 serve soups and 7 flavours of Cup-a-soup. Great taste is in our Nature! Knorr has gone to great lengths to ensure a perfect blend of Ingredients and consistency that give you Restaurant like Soup at home.About Knorr: Just like you, we love everything about food, because no delicious meal is cooked without love. Love for carefully selected Ingredients, flavours and spices, or the aroma of dinner wafting through your home. Love for the people you feed everyday; your family and friends, relatives and guests, the people that matter to you the most. With Knorr as your cooking partner, you can serve your loved ones nutritious and flavourful meals at home. Soup Fun Fact - Soup isnt always served hot. In warmer climates like Spain, cold soup alternatives, like tomato-based gazpacho, are popular. ', 'knorr_14g.jpg', 60, 52, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '0', 0, 29, 14, 0, 0, ''),
(692, 'Medis Adult Diapers 10Pcs, M', 'Medis adult diaper have been designed with your comfort in mind. The medis adult diaper has a super soft inner cotton padding that feels comfortable like cloth and its re-fastenable tapes can be adjusted for a comfortable fit. The medis adult diaper has a super absorbent gel core that keeps you feel dry and fresh for hours, without having to worry about incontinence. Its time to step out of those embarrassing moments, regain your confidence and experience the joy of being free again.', 'medis_diaper.jpg', 63, 69, 0, 1, 600, '340', 0, 0, 1, 'NOS', 0, '0', 0, 12, 500, 0, 0, ''),
(693, 'Aashirvaad Iodized Salt 1kg', 'Ashirvaad Iodized Salt is acquired by evaporating brine or salt water in low basins by wind and sunlight. It is the spirit of all life, enabling excellent fitness and health. It is good that goes into all set of Aashirvaad Iodized salty.', 'aashirvaad_salt_1kg.jpg', 56, 31, 0, 1, 20, '19', 0, 0, 1, 'NOS', 0, '0', 0, 11, 1, 0, 0, ''),
