(698, 'Milky Mist Khova 200g', 'Milky Mist, known for its premium processing of dairy products, offers one of the finest quality khova.Â Milky mist provides you with smooth textured, well processed khova which can enhance the flavor and texture of your dishes very easily. The khova is unsweetened, so that you can add the amount of sugar which suits your taste while preparing delicacies with it.', 'milky_mist_Khova_200g.jpg', 59, 50, 0, 1, 80, '79', 0, 0, 1, 'NOS', 0, '0', 0, 0, 200, 0, 0, ''),
