(755, 'Milky Mist Gulab Jamun Mix 200g Buy 1 get 1 Free', 'This festive season, enhance the joyous occasion with fabulous gifts. Festivals are a great time to be with near and dear ones and enjoy some great moments together. What better way to celebrate than great gifts which makes the occasion even more special. You can choose Milk Mist Gulab Jamun Mix pack to indulge during the festive season.', 'Milky_Mist_Gulab_jamun_mix.jpg', 59, 85, 0, 1, 105, '105', 0, 0, 1, 'NOS', 0, '0', 0, 5, 200, 0, 0, ''),
(756, 'Crust & Crumb Whipping Cream Powder 500g', 'Ice cream cocoa powder and whipping cream powder 50g. Instant mix to make delicious deserts.\r\n\r\n', 'crust_crumb_whipping_cream_powder_500g.jpg', 59, 85, 0, 1, 225, '225', 0, 0, 1, 'NOS', 0, '0', 0, 6, 500, 0, 0, ''),
