(765, 'Fiama Lemongrass & Jojoba Gel Bar ( 125g x 3 ) 3 Pack', 'Fiama Di Wills Gel Bathing Bar Clear Springs contains jojoba beads, extracts of sea weed and lemongrass to give you clear, healthy, smoother skin.', 'Fiama_gel_bar_3_pack.jpg', 63, 68, 0, 1, 180, '180', 0, 0, 1, 'NOS', 0, '0', 0, 0, 375, 0, 0, ''),
(766, 'Himalaya Purifying Neem Face Wash 50ml', 'Neem face wash to prevent pimples and purify the skin. This face wash is a soap free, herbal formulation that gently removes impurities and prevents pimples. Neem, well known for its antibacterial properties, kills problem-causing bacteria, and turmeric effectively controls acne and pimples. Use regularly for clear, soft and pimple-free skin.', 'Himalaya_Purifying_neem_face_wash_50ml.jpg', 63, 71, 0, 1, 65, '65', 0, 0, 1, 'NOS', 0, '0', 0, 6, 50, 0, 0, ''),
(767, 'Himalaya Moisturizing Aloe Vera Face Wash 50ml', 'Aloe Vera, known for its many healing properties, can be used topically or consumed in its juice form. The leaf of this plant has a number of therapeutic properties. It is rich in enzymes, polysaccharides and nutrients which exhibit antibacterial and antifungal action. A natural UV inhibitor, its hydrating, softening and intense moisturizing properties nourish the skin. Indian Gooseberry, due to its antibacterial and astringent qualities, protects skin against infection. It improves the body\'s resistance to infection and also moisturizes the skin. Zedoary has cooling, antiseptic and anti-inflammatory properties, which protect and moisturize the skin.', 'Himalaya_Moisturizing_Aloe_vera_face_wash_50ml.jpg', 63, 71, 0, 1, 65, '65', 0, 0, 1, 'NOS', 0, '0', 0, 3, 100, 0, 0, ''),
(769, 'Rin detergent bar 250g each (pack of 4)', 'Rin Detergent bar is higher in removing the stain from your fabrics without causing any damage or harm to the cloth. It plays an essential part in enabling us to good look by providing demonstrably better whites, giving us the confidence to realize our aims.', 'rin_bar_250g.jpg', 62, 62, 0, 1, 60, '60', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(770, 'GI Premium Kaju Whole 200gm', 'Cashew nuts are seeds of the fruit of the cashew tree. It is white, soft and meaty. It hardens and changes to a darker white once roasted, and has a rich flavour making it the most flavoursome nut. These are rich in monounsaturated fatty acid and minerals such as iron, potassium, phosphorous, copper, zinc and selenium. ', 'rsz_whole_kaju1.jpg', 56, 32, 0, 1, 300, '230', 0, 0, 200, 'Grams', 0, '0', 0, 7, 200, 0, 0, ''),
(771, 'GI Premium Wheat Rava / Goduma Rava 1Kg', 'Wheat Rava is an easy and tasty which includes low-calorie, low-fat, high dietary fiber and rich in Iron, Protein and vitamins. It is a rich supply of nutrients. It has an plenty of vitamins and minerals, but it is mainly rich in vitamin E. ', 'rsz_goduma_rava.jpg', 56, 29, 0, 1, 75, '55', 0, 0, 1, 'Kg', 0, '0', 0, 3, 0, 0, 0, ''),
