(774, 'Fiama Gel Bar Blackcurrant & Bearberry (125g x 3) FREE 150ml Fiama Relax Hand Wash', 'Dive into a luxurious bathing experience with Fiama Di Wills Exotic Dream Ge Bathing Bar. Its is created using a revolutionary Liquid Freezing Technology. Exotic Dream combines exotic natural extracts of Bearberry and Black current with the goodness of skin conditioners, giving you soft, moisturized and youthful skin with a fragrance that last all day long\r\n\r\n', 'DSC_0158.jpg', 63, 68, 0, 1, 180, '180', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
