(776, 'Himalaya pure hands hand sanitizer strawberry 500ml', 'Himalaya PureHands Hand Sanitizer is an effective, alcohol-based hand sanitizer, formulated with the goodness of time-tested herbs. It kills 99.9% of germs, helps prevent infection, and ensures total hand hygiene.', 'DSC_0153.jpg', 63, 69, 0, 1, 250, '250', 0, 0, 1, 'NOS', 0, '0', 0, 1, 500, 0, 0, ''),
(777, 'Himalaya pure hands hand sanitizer litchi 500ml', 'Himalaya PureHands Hand Sanitizer is an effective, alcohol-based hand sanitizer, formulated with the goodness of time-tested herbs. It kills 99.9% of germs, helps prevent infection, and ensures total hand hygiene.', 'DSC_0152.jpg', 63, 69, 0, 1, 250, '250', 0, 0, 1, 'NOS', 0, '0', 0, 2, 500, 0, 0, ''),
(778, 'Sunfeast Yippee Noodles Magic Masala 280g', 'Sunfeast yippee magic masala noodles gives you an energetic and invigorating experience for your taste buds. It is 100 percent vegetarian and has dietary fibre which helps digestion and satisfies hunger. Take pleasure in the tanginess of tomato in the noodles that’s masala flavoured and non sticky. It comes with a wheat noodle cake and a flavour sachet of real herbs and spices sourced and grown in India.', 'YIPPEE_NOOODLES_280GM.jpg', 60, 51, 0, 1, 46, '44', 0, 0, 1, 'NOS', 0, '0', 0, 30, 280, 0, 0, ''),
(779, 'SunFeast Dark Fantasy Choco Fills', 'Savour the taste of bliss as you bite into the new Sunfeast Dark Fantasy Choco Fills. The rich crust enrobes the luscious and smooth choco creme made to mesmerize your taste buds. Indulge your senses with the heavenly taste of Sunfeast Dark Fantasy Choco Fills.', 'sunfeast-Dark-fantasy-choco-fills-biscuits-75gm-400x400.jpg', 61, 60, 0, 1, 30, '30', 0, 0, 1, 'NOS', 0, '0', 0, 31, 75, 0, 0, ''),
(780, 'Sunfeast Mom\'s Magic Cashew &Almond', 'Sunfeast Mom\'s Magic (Cashew & Almond) is a tasty butter cookie with a crispy texture and balanced flavour. It is sprinkled with cashew and almond flakes, giving it a rich delectable taste.', 'Sunfeast_Moms_Magic_100g.jpg', 61, 60, 0, 1, 20, '20', 0, 0, 1, 'NOS', 0, '0', 0, 60, 20, 0, 0, ''),
(789, 'Saffola Masala Oats Masala & Coriander 38g (pack of 12)', 'Saffola Masala Oats are bursting with flavour and are made from 100% natural wholegrain oats along with real vegetables and the choicest of masalas. Eating Saffola Masala Oats as part of your daily routine is not just fantastically healthy and delicious, but also requires minimal effort. The Indian palate is naturally inclined towards freshly prepared, hot and spicy foods. We crave for those savoury flavours during different times of the day. You can enjoy a delicious bowl of Saffola Masala oats Masala & Coriander flavour now with a crunch at any time of the day. Top up your bowl with these multigrain crunchies for a tasty and surprising crunch. It gets ready in just 3 minutes and is a convenient tasty yet healthy any time meal.\r\n\r\n', 'saffola_oats_pack_of_121.jpg', 60, 53, 0, 1, 180, '170', 0, 0, 1, 'NOS', 0, '0', 0, 15, 0, 0, 0, ''),
(790, 'Saffola Masala Oats Masala & Coriander 38g', 'Saffola Masala Oats are bursting with flavour and are made from 100% natural wholegrain oats along with real vegetables and the choicest of masalas. Eating Saffola Masala Oats as part of your daily routine is not just fantastically healthy and delicious, but also requires minimal effort. The Indian palate is naturally inclined towards freshly prepared, hot and spicy foods. We crave for those savoury flavours during different times of the day. You can enjoy a delicious bowl of Saffola Masala oats Masala & Coriander flavour now with a crunch at any time of the day. Top up your bowl with these multigrain crunchies for a tasty and surprising crunch. It gets ready in just 3 minutes and is a convenient tasty yet healthy any time meal.\r\n\r\n', 'saffola_masala_oats_masala_coriander_40g1.jpg', 60, 53, 0, 1, 15, '15', 0, 0, 1, 'NOS', 0, '0', 0, 60, 38, 0, 0, ''),
(791, 'Parachute 100% Pure Coconut Hair Oil 250ml', 'Parachute Coconut oil- India\'s No. 1 coconut oil contains only the goodness of 100% pure coconut oil. It is made from naturally sun-dried coconuts sourced from the finest farms of our country. The oil is extracted from the nuts through a meticulous hands free process.', 'parachute_coconut_oil_250ml1.jpg', 63, 70, 0, 1, 95, '94', 0, 0, 1, 'NOS', 0, '0', 0, 9, 250, 0, 0, ''),
(792, 'Parachute Advansed Aloe Vera Coconut Hair Oil 150ml', 'Its nourishing coconut oil makes your hair strong, and the aloe vera extracts help keep it soft. Hair care tip, regularly massage on scalp and apply across the length of the hair till tip for best results. Parachute advanced aloe vera enriched coconut hair oil for stronger, softer and silkier hair.', 'parachute_advanced_aleo_vera_150ml1.jpg', 63, 70, 0, 1, 75, '75', 0, 0, 1, 'NOS', 0, '0', 0, 5, 150, 0, 0, ''),
(793, 'Parachute Advansed Ayurvedic Coconut Hair Oil 95ml', 'Processed by tel pak vidhi, this Ayurveda hair oil nourishes hair to shine with health. Key benefits of this oil are controls hair fall promotes hair growth keep hair healthy, long and thick reduces dandruff prevents dryness of scalp improves blood circulation to follicles prevent premature greying.', 'parachute_ayurvedic_oil_95ml1.jpg', 63, 70, 0, 1, 60, '60', 0, 0, 1, 'NOS', 0, '0', 0, 4, 95, 0, 0, ''),
(794, 'Parachute Advansed Jasmine Coconut Hair Oil 190ml', 'Parachute advansed jasmine is the modern face of Parachute advansed and is the largest variant in the portfolio. It was launched in the year 2000 as a non sticky, light and fragrant hair oil while retaining the goodness of coconut, thereby addressing the consumer\'s need for nourishment with pleasing sensorials.', 'parachute_advansed_jasmine_190ml1.jpg', 63, 70, 0, 1, 87, '87', 0, 0, 1, 'NOS', 0, '0', 0, 3, 190, 0, 0, ''),
(795, 'Revive Instant Starch Anti Bacteria 200g', 'Revive powder gives consumers the convenience of an instant cold water starch at home. It does not leave patches on coloured clothes like traditional powders. It can also be used on terry-cottons.', 'revive_instant_starch_200g1.jpg', 62, 62, 0, 1, 65, '65', 0, 0, 1, 'NOS', 0, '0', 0, 6, 200, 0, 0, ''),
(796, 'Revive Liquid Stiffener 200g', 'Cotton clothes are always a difficult task to manage. They tend to become lifeless after a wash or become very stiff with patches after a starch. Starching cotton clothes is not easy either. It requires the right amount of starch and water, else the colored clothes will have white patches all over. Revive liquid stiffener is a miraculous solution to this problem. Revive Liquid Stiffener dissolves evenly in water and delivers patch-free starching of cottons and cotton blends. As with Revive powdered starch it provides the ease and convenience of cold-water starching. Unlike other starches, it can be used on whites as well as on colored fabrics. Revive liquid stiffener adds life to your cottons and makes them soft and fresh. It is an easy and convenient way to starch your cottons. It can be used even on terry-cottons. The versatility of this product has made it one of the largest selling product in the category. Marketed by Marico, Revive liquid stiffener is the best way to starch your cottons to add life and sparkle to your clothes. It can be used on both white and colored fabrics.\r\n\r\n', 'revive_liquid_stiffener_200g.jpg', 62, 62, 0, 1, 71, '71', 0, 0, 1, 'NOS', 0, '0', 0, 4, 200, 0, 0, ''),
(797, 'Patanjali Kesh Kanti Aloe Vera Hair Cleanser 200ml', 'Patanjali Kesh Kanti Aloe Vera Hair Cleanser is packed with the cleansing and restoring properties of Aloe vera, combined with a variety of nourishing herbs. The extracts of the Aloe plant calm affected scalps and moisturize dry and damaged hair. Tulsi, turmeric, reetha, and amla are natural disinfectants, cleansers and moisturizers that regenerate dehydrated hair and bring limp hair to life. Shikakai softens and brings out the natural radiance of hair stalks, making your hair look healthy and lustrous the natural way. Use as often required to keep hair protected and clean from the weather and environmental damage.\r\n\r\n', 'patanjali_kesh_kanti_aloevera_200ml.jpg', 63, 70, 0, 1, 85, '85', 0, 0, 1, 'NOS', 0, '0', 0, 6, 200, 0, 0, ''),
(798, 'Patanjali Kesh Kanti Natural Hair Cleanser 200ml', 'Patanjali Kesh Kanti Hair Cleanser is a 100% natural herbal shampoo that strengthens and shines your hairs. It is fine at reducing hair loss and removing dandruffs, also prevents hardness and dryness from your hair. It provides necessary nutrients to your hair and makes it healthy and strong.', 'Patanjali-Kesh-Kanti-Natural-Hair-Cleanser-Shampoo.jpg', 63, 70, 0, 1, 75, '75', 0, 0, 1, 'NOS', 0, '0', 0, 6, 200, 0, 0, ''),
(799, 'Patanjali Kesh Kanti Hair Cleanser With Milk Protein 200ml', 'Patanjali Kesh Kanti Milk Protein Hair cleanser hydrates hair and scalp. The milk protein utilized in this shampoo not only cleanses dry hair softly but moreover repairs hair spoil with continuous age.', 'Patanjali-Kesh-Kanti-Hair-Cleanser-with_milk_protein.jpg', 63, 70, 0, 1, 95, '95', 0, 0, 1, 'NOS', 0, '00', 0, 0, 200, 0, 0, ''),
(800, 'Patanjali Kesh Kanti Anti-Dandruff Hair Cleanser 200ml', 'Kesh Kanti Anti Dandruff Shampoo gives you a deeply cleansing action that acts on the dirt contained in the scalp and reduces the dandruff to a great extent. It also leaves you with glossy and healthy looking hair thanks to its nourishing properties and elements.', 'Kesh_Kanti_Anti_Dandruff_Hair_Shampoo.png', 63, 70, 0, 1, 110, '110', 0, 0, 1, 'NOS', 0, '0', 0, 6, 200, 0, 0, ''),
(801, 'Meera shampoo Anti Dandruff With Small Onion Fenugreek 80ml', 'Meera Hairfall Care Shampoo, with the goodness of Shikakai and Badam, helps in making your hair Strong and Healthy. Saponin rich Shikakai is known to gently cleanse hair whilst Vitamin E enriched Almond is known to nourish hair to make them look healthy.', 'meera_shampoo.jpg', 63, 70, 0, 1, 68, '68', 0, 0, 1, 'NOS', 0, '0', 0, 6, 80, 0, 0, ''),
(802, 'meera 100% pure coconut oil 175ml', 'Meera Pure Coconut Hair Oil. Meera Pure Coconut Hair Oil is a triple-filtered and refined oil. The pure coconut oil is made from the finest dala copra. It is an edible grade coconut oil that can also be used on skin and hair.', 'meera_coconut_oil.jpg', 63, 70, 0, 1, 69, '69', 0, 0, 1, 'NOS', 0, '0', 0, 4, 175, 0, 0, ''),
(803, 'Nyle Advanced Shampoo Anti Dandruff 180ml', 'Every drop of Nyle Naturals Advanced Shampoo is Paraben free and filled with the goodness of natural extracts of Curd, Aloe Vera, and Lemon. It not only fights dandruff but also smoothens##hair and helps to improve scalp’s health. The pH balance of Nyle shampoo gives you the additional damage protection. It provides soothing scalp care and thereby uprooting dandruff troubles. This shampoo is free from any harmful ingredients and contains nature hair-care ingredients, further it nourishes the deep scalp and avoids the scalp from going dry and getting dandruff-prone. Regular usage makes hair healthy and strong.\r\n\r\n', 'nyle_advanced_shampoo.jpg', 63, 70, 0, 1, 110, '110', 0, 0, 1, 'NOS', 0, '0', 0, 1, 180, 0, 0, ''),
(804, 'Meera Shampoo Strong & Healthy Kukudukai & Badam 80ml', 'The all new Meera Strong & Healthy shampoo contains a unique Nourishment Lock System along with natural ingredients. It contains Kunkudukai that is known to gently cleanse your hair whilst Vitamin E enriched Almond is known to nourish it, giving you stronger and healthier hair with every wash.', 'meera_shampoo_strong_healthy.jpg', 63, 70, 0, 1, 62, '62', 0, 0, 1, 'NOS', 0, '0', 0, 5, 80, 0, 0, ''),
(805, 'Nyle Naturals Shampoo Anti Dandruff 180ml', 'Every drop of Nyle Shampoo contains a unique nutrition boost complex, filled with the goodness of Badam, Amla and Coconut Milk. Nyle Hairfall Defence shampoo works on your scalp, hair and hair tips to fight the 3 types of hair loss – hair fall from roots, breakage from the middle and split ends.', 'nyle_naturals_shampoo.jpg', 63, 70, 0, 1, 95, '95', 0, 0, 1, 'NOS', 0, '0', 0, 1, 180, 0, 0, ''),
(806, 'Chik Protein Solution Thick & Glossy 175ml', 'CHIK Thick & Glossy black shampoo contains the goodness of Black Tea, Badam & Bhringraj oil. It helps to enhance hair shine & strengthens your hair thereby giving you thicker looking & glossy hair. The shampoo helps you get shiny hair without causing any harmful effects.', 'chik-thick-and-glossy-shampoo-180-ml.jpg', 63, 70, 0, 1, 89, '89', 0, 0, 1, 'NOS', 0, '00', 0, 3, 175, 0, 0, ''),
(807, 'Indica Easy 10 Minutes Shampoo Hair colour 18ml', 'Indica easy is a revolutionary product in hair color industry. Gone are the days when you required brush and bowl for coloring hair. Indica easy comes in a shampoo based format which can be directly applied by hand with the help of gloves. It is one of the most convenient forms of applying color where you don’t need to seek anyone help for coloring. So why wait! Color your hair! Do it easy.\r\n\r\n', 'indica_easy.png', 63, 70, 0, 1, 25, '25', 0, 0, 1, 'NOS', 0, '0', 0, 12, 18, 0, 0, ''),
(808, 'Patanjali Coconut Oil 200ml', 'Patanjali Coconut Oil does not only promotes healthy and long hair but also can be used to smoothen , soften your cuticles,dry skin.', 'patanjali_coconut_oil.jpg', 63, 70, 0, 1, 75, '75', 0, 0, 1, 'NOS', 0, '0', 0, 6, 200, 0, 0, ''),
(809, 'Patanjali Herbal With Lemon, Neem & Aloe Vera Facial Foam 60g', 'Patanjali Herbal with Lemon, Neem and Aloe Vera facial foam is made from the natural extract of Aloe Vera, Neem and haldi which cleanse gently, nourish and revitalize the skin tissues, to make complexion fresh, smooth and beautiful.', 'patanjali_herbal.jpg', 63, 71, 0, 1, 60, '60', 0, 0, 1, 'NOS', 0, '0', 0, 6, 60, 0, 0, ''),
(810, 'Patanjali Soundarya Face Wash 60ml', 'It nourishes and revitalizes the skin tissues to make complexion fresh, smooth and beautiful. It gently cleanses and remove dirt and oil, while also removing makeup effectively. It has a mild fragrance, which doesn\'t irritate skin.', 'patanmjali_soundarya_face_wash.jpg', 63, 71, 0, 1, 60, '60', 0, 0, 1, 'NOS', 0, '0', 0, 6, 60, 0, 0, ''),
(811, 'Patanjali Kesh Kanti Oil 120ml', 'Patanjali Kesh Kanti Hair Oil provides deep nourishment and strengthens hair roots, reduces hair fall and dandruff, and prevents split ends and hair from greying.\r\n', 'patanjali_kesh_kanti_oil.jpg', 63, 70, 0, 1, 130, '130', 0, 0, 1, 'NOS', 0, '0', 0, 4, 120, 0, 0, ''),
(815, 'Patanjali Super Dishwash Bar 175g', 'Patanjali Super Dishwash Bar is an organic product and made of non-toxic and 100% natural ingredients. This soap doesn\'t contain any artificial additives like colours, fragrances, enzymes,bleaches or harmful chemicals. Ideal for all types of dishes including ceramic and non-stick ware.', 'Patanjali-Super-Dishwash-Bar.jpg', 62, 63, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '0', 0, 35, 175, 0, 0, ''),
(816, 'Patanjali Dant Kanti Medicated Oral Gel 100g', 'A unique fluorinated blue gel that is infused with the powerful herbal extracts of SphatikaBhasma and Kalmishora, the paste tightens gums, tackles germs and infestations and provides much-needed relief from tingling sensations. The herbal composition keeps decay, cavities and germs at bay.', 'patanjali_dant_kanti_medicated_oral-gel.jpg', 63, 67, 0, 1, 45, '45', 0, 0, 1, 'NOS', 0, '0', 0, 6, 100, 0, 0, ''),
(817, 'Patanjali Dant Kanti Natural ToothPaste 200g', 'Improve oral health with Dant Kanti’s time-tested herbal ingredients. From offering dental protection to dental beauty, Dant Kanti works to guard and beautify your teeth. Packed with the goodness of nature, Dant Kanti dental cream offers health in a variety of ways. Akarkara and babul protect the gums; neem, timbaru, turmeric and cloves remove and offer protection from bacteria; pudhina and pipli refresh the gums; peelu and maju phal make gums stronger. Dental problems such as pyria, gingivitis, and bad odour begin to diminish when used every day.\r\n', 'Patanjali-Dant-Kanti-Natural-Tooth-Paste.jpg', 63, 67, 0, 1, 85, '85', 0, 0, 1, 'NOS', 0, '0', 0, 10, 200, 0, 0, ''),
(818, 'Sensodyne Flouride Toothpaste Fresh Mint 150g', 'Sensodyne toothpaste works to relieve tooth pain due to sensitive teeth and provides lasting protection all day, every day when used as directed. Since being introduced in 1961, Sensodyne toothpaste has become a well-recognized sensitive toothpaste with dentists around the world.', 'Sensodyne-Fresh-Mint-Toothpaste-75g.jpg', 63, 67, 0, 1, 190, '190', 0, 0, 1, 'NOS', 0, '0', 0, 4, 75, 0, 0, ''),
