(875, 'GI Premium Urad Gota /Gundu Minapappu 5kg', 'Urad wash gota is a skinned, off-white colored lentil with a sturdy savor and is native to India. It is a superb supply of protein and dietary fiber. It is one of the finest plant sources of protein. Minerals such as folic acid, iron, magnesium and potassium, and vitamin B are also there.	\r\n', 'rsz_gi_premium_urad_gota2.jpg', 56, 28, 0, 1, 800, '640', 0, 0, 1, 'NOS', 0, '0', 0, 3, 5, 0, 0, ''),
(876, 'GI Premium Moong Dal/ Pessaru Pappu 5kg', 'Moong beans is a popular food among vegetarians since it contains a lot of proteins and fiber. It is one of the easiest dals to digest and for this reason it is often given to people recovering from an illness, specially a stomach upset. It has antioxidants which is very healthy for the good functioning of the human body. It is a good balanced diet and could be included in our daily.	\r\n', 'rsz_1moong_dal2.jpg', 56, 28, 0, 1, 845, '675', 0, 0, 1, 'NOS', 0, '0', 0, 1, 5, 0, 0, ''),
(877, 'Patanjali Pure Honey 1KG', 'Patanjali Pure honey is a sweet aliment produced by honey bees and derived from the nectar of flowers and Best pure honey available with our standard. Honey gets its sweetness from the mono saccharide fructose and glucose and has approximately the same relative sweetness as that of granulated sugar (97% of the sweetness of sucrose, a disaccharide). Patanjali pure Natural Honey is rich in fructose, minerals, vitamins and other nutritious elements. Honey is not only a natural sweetener but a multi functional food that offers ample health benefits.', 'Patanjali_Honey_1L.jpg', 57, 38, 0, 1, 275, '270', 0, 0, 1, 'NOS', 0, '0', 0, 2, 1, 0, 0, ''),
(878, 'Patanjali Cow\'s Ghee 1L with Free Patanjali Turmeric Powder 100g', 'Patanjali ghee is processed from pure cow-milk, it is naturally beneficial for body and helps in improving the immune system. Rich in taste and aroma, it can be used for stir frying, tempering etc.', 'Patanjali_Ghee_1L.jpg', 57, 37, 0, 1, 565, '560', 0, 0, 1, 'NOS', 0, '0', 0, 3, 1, 0, 0, ''),
(879, 'Annapurna Appalam / Appadalu 100g', 'Annapurna Appalam 100gm with ingredients Lentil Flour, Rice flour, salt, spices, edible vegetable oil, sodium Bicarbonate.', 'appalam.jpg', 56, 30, 0, 1, 28, '28', 0, 0, 1, 'NOS', 0, '0', 0, 3, 100, 0, 0, ''),
(880, 'Saffola Honey 250g', 'Discover the taste of purity in every drop of Saffola Honey! Every batch of Saffola Honey is tested using the most advanced NMR Test (Nuclear Magnetic Resonance) in one of the best-in-class German laboratories to ensure that it is pure, free from any form of adulteration and with no added sugar. From the beehives to the pack, Saffola Honey goes through 60+ quality checks & passes through multiple filtration stages to remove impurities. Drizzle the deliciousness of Saffola Honey on your rotis, toast, pancakes, in cereal or swirl some of this honey in your cup of green tea/coffee for everyday health.\r\n\r\n', 'saffola_honey_250g.jpg', 57, 38, 0, 1, 110, '110', 0, 0, 1, 'NOS', 0, '0', 0, 5, 250, 0, 0, ''),
(881, 'GI Premium Sesame Seeds / Nuvulu 500g', 'Till adds a nutty taste and a delicate, almost invisible, crunch to several Asian dishes. Sesame seeds are tiny, flat oval seeds with a nutty flavour and a delicate, almost invisible crisp. Not only are sesame seeds a very fine supply of copper and manganese, but they are also a fine supply of magnesium, calcium, iron, phosphorus, vitamin B1, dietary fibre and zinc.	\r\n', 'rsz_gi_premium_sesame_seeds_til2.jpg', 58, 39, 0, 1, 158, '130', 0, 0, 1, 'NOS', 0, '0', 0, 3, 500, 0, 0, ''),
(882, 'GI Premium Shahjeera 20g', 'Shahjeera, as the name says, is also identified as royal cumin due to its robust cumin smell and taste.	\r\n', 'rsz_shahi_jeera2.jpg', 58, 39, 0, 1, 25, '18', 0, 0, 1, 'NOS', 0, '0', 0, 3, 20, 0, 0, ''),
(883, 'Cinthol Lime Refreshing Deo Soap ( Pack Of 4 ) 100g Each', 'It\'s enhanced lime fragrance revitalizes your senses to give you a fantastic bathing experience. Cinthol Lime Bath Soap has a great citrus scent that lingers throughout the day and leaves your skin feeling fresh and rejuvenated for the entire day.', 'CINTHOL_LIME.jpg', 63, 68, 0, 1, 99, '99', 0, 0, 1, 'NOS', 0, '0', 0, 9, 400, 0, 0, ''),
(884, 'Tata Tea Gemini 250g', 'Tata Tea Gemini has been the undisputed market leader in Andhra Pradesh and Telangana combined, in volume as well as market share for many years. It is positioned as ‘the strong tea for strong family relationships’. Gemini was launched in Andhra Pradesh in 1978. It was initially introduced to take on competitor dust brands in Andhra Pradesh. However, the turning point came when the brand cashed-in on a market situation and managed to garner considerable gains from competition. That is when prospective consumers saw merit in trying Gemini and became its loyalists, thanks to the superior taste and consistent delivery standards.At present, Gemini enjoys a 27% volume and value share, which is significantly ahead of all competing brands in the dust and leaf segments.', 'tata_tea_gemini_250g.jpg', 60, 84, 0, 1, 100, '99', 0, 0, 1, 'NOS', 0, '0', 0, 4, 250, 0, 0, ''),
(885, 'Tata Tea Chakra Gold Premium Tea 250g', 'Tata Tea Chakra Gold is the second largest tea brand in South India and the ninth largest across India, in terms of market share. Originally launched in 1985 as Chakra Premium Dust Tea, the product was renamed Chakra Gold in 1989. Enjoy the Tata Tea chakra Gold everyday as you wake up to follow your hearts desires.', 'chakra_gold.jpg', 60, 84, 0, 1, 160, '158', 0, 0, 1, 'NOS', 0, '0', 0, 4, 250, 0, 0, ''),
(886, 'Snapin Mixed Herbs 20g', 'By snapin is a specially made blend of herbs that works to enhance the favour of soups, salads, vegetables, patties, pizzas, pastas and various meat dishes. Snapin mixed herbs is a versatile seasoning mix that can also be used directly in cooking.', 'snapin_mixed_herbs.jpg', 58, 41, 0, 1, 79, '79', 0, 0, 1, 'NOS', 0, '0', 0, 23, 20, 0, 0, ''),
(887, 'Snapin Chilli Flakes 35g', 'By snapin is made from the choicest red chillies, crushed to flake size to add fire and flavour to your food. Snapin chilly flakes imparts a great natural red colour to elevate the aesthetics of your daily cooking. Use snapin chilly flakes along with snapin oregano to bring out the finer flavours of your pizza.', 'snapin_chilli_flakes.jpg', 58, 41, 0, 1, 65, '65', 0, 0, 1, 'NOS', 0, '0', 0, 23, 35, 0, 0, ''),
(888, 'khadi Herbal Soap Rose & Honey With Rose Petal 125g', 'Herbal Rose & Honey With Rose Petals Soap is wrapped inside the petals of rose and honey,\r\nThis wonderful soap calms and uplifts your senses and relieves you from stress and insomnia.', 'khadi_herbal_rose-and-honey-with-rose-petal.jpg', 63, 68, 0, 1, 75, '73', 0, 0, 1, 'NOS', 0, '0', 0, 12, 125, 0, 0, ''),
