(890, 'Khadi Herbal Shampoo Shikakai & Honey 210ml', 'Vagad`s Khadi shampoo contains Shikakai and Honey extract with their wide range of benefits.', 'khadi-herbal-shampoo_shikakai.jpg', 63, 70, 0, 1, 169, '165', 0, 0, 1, 'NOS', 0, '0', 0, 4, 210, 0, 0, ''),
(891, 'Khadi Herbal Shampoo Neem & Aloe Vera 210ml', 'Vagad`s Khadi shampoo contains Neem and Aloevera with some other herbs like basil extract and green tea extract which provide your hair a good nutritive value. It protect your hair from dandruff, itchiness and dryness.', 'khadi-neem-aloe-vera-herbal-shampoo.jpg', 63, 70, 0, 1, 169, '165', 0, 0, 1, 'NOS', 0, '0', 0, 4, 210, 0, 0, ''),
(892, 'Khadi Herbal Shampoo Amla & Bhringraj 210ml', 'This formula of Vagad`s Khadi shampoo is perfect blend of Amla and Bhringraj which together can reduces your hair fall and promotes hair growth. This also protect your hair against dandruff.', 'amla-bhringraj-khadi-herbal-shampoo.jpg', 63, 70, 0, 1, 169, '165', 0, 0, 1, 'NOS', 0, '0', 0, 4, 210, 0, 0, ''),
(893, 'khadi Herbal Soap Multani - Rose 100g', 'Vagad`s khadi multani and rose milky soap for skin brightening, deep cleans your skin and removes excess oil. Rose extract gives healthy and glowing looking skin our focus is to provide our customers with a great online shopping experience and deliver high standards of customer service.\r\n\r\n', 'Multani-Rose-Soap-.jpg', 63, 68, 0, 1, 99, '95', 0, 0, 1, 'NOS', 0, '0', 0, 12, 100, 0, 0, '');
