(895, 'D\'nature Fresh California Walnuts 250g', 'D\'nature Fresh brings to you the choicest selection of dry fruits, nuts & dates, 100% natural. This premium hand-picked Walnuts from California (as displayed in the image) comes in a very sophisticated pack keeping in mind all the hygienic precautions while packing. After the arrival of these nuts at our processing unit, we package them very neatly with respect to all compliance and hygienic conditions. These Walnuts are vacuum packed and then placed in a paper box, this helps in retaining the freshness of the nuts. Walnuts are rich in B- complex Vitamin , Vitamin - E , Potassium , Magnesium , Calcium , Phosphorus & Iron . Nuts offers vegetarian an abundance of nutrients , although they contains a heavy number calories.', 'walnuts.jpg', 56, 32, 0, 1, 640, '480', 0, 0, 1, 'NOS', 0, '0', 0, 8, 250, 0, 0, ''),
