(897, 'Pears Pure & Gentle Bathing Bar 150g', 'Pears Pure & Gentle is the original 225 years old glycerin bar that gives the gentle care of natural oils & 98% pure glycerin to your skin. It is the world’s first transparent soap and advertised the brand. Its undisputed credentials on mildness & purity, driven by its unique shape and transparency lend the brand equity that lasts till this date. Pears is amongst the iconic brands in India. The Pears bar with its 98% pure glycerin preserves the beauty of your skin keeping it young. Pears treats your skin gently causing lesser damage than even baby soaps.', 'Pears_pure_and_gentle_100g.jpg', 63, 68, 0, 1, 65, '65', 0, 0, 1, 'NOS', 0, '0', 0, 20, 150, 0, 0, ''),
(898, 'Parle Nutricrunch Honey & oats Digestive Cookies Buy 5 get 1 Free', 'Parle Nutricrunch Honey & Oats are among the most preferred biscuits among the biscuit lovers. This health snack has no trans-fat, no cholesterol, no artificial preservatives and no colors and flavors. Crunchy, light and neutral to taste, this lite crackers are ideal accompaniments for any time of the day.', 'parle_Nutricrunch_6_pack.jpg', 61, 57, 0, 1, 120, '100', 0, 0, 1, 'NOS', 0, '0', 0, 5, 600, 0, 0, ''),
(902, 'Cadbury Dairy Milk Chocolate 50g', 'Cadbury Dairy Milk Chocolate is for those everyday moments of joy that you want to share with your near and dear ones with something sweet. Just one bite will take you into the world of warmth, happiness and spontaneous fun. Rich, smooth and creamy Classic Milk Chocolate which gives you more joy in every bite', 'Cadbury-Dairy-Milk-Chocolate1.jpg', 61, 61, 0, 1, 40, '40', 0, 0, 1, 'NOS', 0, '00', 0, 10, 50, 0, 0, ''),
