(909, 'Maggi 2-Minute Noodles Party Time Wow Recipe 560g Pack Of 8', 'Maggi Masala Noodles with your favourite masala taste! Comes with the goodness of Iron. Provides you with 15% of your daily Iron requirement. Containing your favourite masala taste, MAGGI noodles are made with the finest quality spices and ingredients.', 'Maggi-Masala-Noodles-560-g-Pack-of-8.jpg', 60, 51, 0, 1, 91, '90', 0, 0, 1, 'NOS', 0, '0', 0, 18, 560, 0, 0, ''),
