(940, 'GI Premium Rock Salt 1Kg', 'Rock Salt is a chemical sedimentary rock that forms from the evaporation of ocean or saline lake waters. It is also known by the mineral name \"halite\". It is rarely found at Earth\'s surface, except in areas of very arid climate.', 'LRM_20200806_124502.jpg', 56, 31, 0, 1, 120, '100', 0, 0, 1, 'NOS', 0, '0', 0, 5, 1, 0, 0, ''),
(941, 'Saffola Masala Oats - Classic Masala, 500 g', 'Saffola Masala Oats has a burst of flavours and is made from 100% natural wholegrain oats along with real vegetables and the choicest of masalas. Eating Saffola Masala Oats as part of your daily routine is not just fantastically healthy and delicious, but also requires minimal effort for preparation; ready in 3 minutes. It satisfies the cravings for those savoury flavours as a breakfast cereal or during different times of the day. Ingredients: Oats (73.9%), Maltodextrin, Salt, Spices and Condiments (3.4%) (Onion, Tumeric, Pepper Cumin, Garlic, Fenugreek, Clove, Nutmeg, Red Chilli), Dried Vegetables (Carrots (l .15%), Onion Flakes (1.15%), Green Peas (O.69%), Sugar, Starch, Hydrolysed Vegetable Protein, Wheat Powder, Edible Vegetable Oil, Flavour Enhancer (627, 631 Antioxidant (320). Contains added Natural and Nature Identical Flavouring Substances.	\r\n', 'saffola_oats_classic_masala.jpg', 60, 53, 0, 1, 190, '188', 0, 0, 1, 'NOS', 0, '00', 0, 1, 500, 0, 0, ''),
(942, 'Mangaldeep Puja Agarbattis Sandal 80 sticks', 'The finest Sandal Agarbattis from Mangaldeep brand for your daily puja. Its delightful fragrance makes every prayer a special experience. It dispels your worries and helps you have an undisturbed conversation with God. Be one with God.', 'mangaldeep_sandal1.jpeg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(943, 'Mangaldeep Puja Agarbattis Deetyaa 80 sticks', 'Mangaldeep Deetyaa Agarbatti is made out of quality materials to produce a highly inspiring fragrance and releases powerful scent and the pleasant fragrance lasts for a longer duration.', 'mangaldeep_deetyaa1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 5, 0, 0, 0, ''),
(944, 'Mangaldeep Puja Agarbattis Pushpanjali 80 sticks', 'Its delightful fragrance makes every prayer a special experience. It dispels your worries and helps you have an undisturbed conversation with God. The fragrance spreads throughout the room and creates an auspicious environment. Start your day with Mangaldeep Puja Agarbattis.\r\n', 'mangaldeep_pushpanjali1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
(945, 'Mangaldeep Puja Agarbattis Jajimalli 80 sticks', 'Bring home finest Jathimalligai Agarbattis from Mangaldeep brand for your puja. Its delightful fragrance makes every prayer a special experience. It dispels your worries and helps you have an undisturbed conversation with God.\r\n', 'mangaldeep_jajimalli1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(946, 'Mangaldeep Puja Agarbattis Lavender 80 sticks', 'Immerse yourself in the soothing and long-lasting fragrance of mangaldeep lavender, which will spread its pleasant aroma in the room and help you relax and calm your senses. They can be used during pooja, meditation or any such occasion. The strong scent instantly uplifts the home atmosphere.\r\n', 'mangaldeep-pooja-agarbatti-lavender-84-sticks1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 5, 0, 0, 0, ''),
(947, 'Mangaldeep Puja Agarbattis Treya Power of 3  80 sticks', 'Mangaldeep Treya Puja Agarbattis proposes you now Sandalwood Agarbatti which has got exciting smell. The raw resources used here are bamboo essence, sticks, perfumed herbs etc. They are one of the finest quality incense sticks to please you with its sturdy fragrance since almost every rituals in Indian religion comprises the use of Agarbatti.', 'Mangaldeep-Treya-Power-Of-3-in-1-Agarbattis-1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
(948, 'Mangaldeep Puja Agarbattis Marigold 80 sticks', 'Mangaldeep Marigold - Sugandh atoot upasana ki. Mangaldeep Marigold provides an auspicious fragrance for a divine experience while performing puja. Experience marigold fragrance in agarbattis for the first time. Start your day with Mangaldeep Puja Agarbattis.', 'mangaldeep_marigold1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
(949, 'Mangaldeep Puja Agarbattis Fragrance Of Temple 84 sticks', 'Mangaldeep Temple - Lord Jagannath\'s Favourite Fragrances is a unique agarbatti pack created for Lord Jagannath\'s devotees with the following specialties. Ingredient - Each of the ingredients used in creating the agarbattis constitute fragrances derived from the favourite offerings of Lord Jagannath.\r\n', 'mangaldeep_temple1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
(950, 'Mangaldeep Puja Agarbattis Fragrance Of Temple Silver Tradition 50 sticks', 'Bring home the divine essence of Temple diya. Mangaldeep Temple helps you bring the divinity of temple which is considered as the most sacred at your home. Enhance your devotional puja experience with superior agarbattis.', 'Mangaldeep-Temple-Silver-Tradition-Agarbattis1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
(951, 'Mangaldeep Puja Agarbattis Fragrance Of Temple Gold Tradition 40 sticks', 'Bring home the divine essence of Temple Yagna. Mangaldeep Temple helps you bring the divinity of temple which is considered as the most sacred at your home. Enhance your devotional puja experience with superior agarbattis.', 'Mangaldeep-Temple-Gold-Tradition-Agarbatitis-1.jpg', 57, 86, 0, 1, 50, '49', 0, 0, 1, 'NOS', 0, '0', 0, 5, 0, 0, 0, ''),
(952, 'Tide With Extra power Plus Detergent Powder 1Kg', 'Tide detergent is the next generation washing powder that keeps your hands safe and also ensures your clothes are bright and colorful. There is no need for extra labor to wash your clothes as stains and dirt are easily washed out. Tide Plus Detergent Powder is the ultimate household item that can keep your clothes clean and lasts for an entire month. A spoonful of detergent serves the purpose for a bucketful of dirty linen.\r\n\r\n', 'tide_detergent_1kg.jpg', 62, 62, 0, 1, 106, '105', 0, 0, 1, 'NOS', 0, '0', 0, 6, 1, 0, 0, ''),
(953, 'Axe Signature Denim Shaving Cream 60g (Free 30% Extra)', 'Crafted for a rich creamy lather, this shaving cream produces the kind of moisturising foam which makes it easier for you to shave that rough patch of stubble from your skin. The spicy, rich, masculine scent with bursts of fresh citrus leaves your skin soft and moisturised, making it irresistible to the touch.', 'Axe-Signature-Denim-Shaving-Cream-30--Extra.jpg', 63, 72, 0, 1, 68, '65', 0, 0, 1, 'NOS', 0, '0', 0, 3, 60, 0, 0, ''),
(954, 'Gillette Regular Shaving Cream 70g (33% Extra Free)', 'Its deep, rich formula of hydrating emollients and lubricants softens facial hair and protects even the most sensitive skin while you shave. So a close shave is also a comfortable shave. Designed to partner with the Gillette fusion shaving systems.\r\n', 'gillette-regular-shaving-cream-93_1g.jpeg', 63, 72, 0, 1, 69, '68', 0, 0, 1, 'NOS', 0, '0', 0, 5, 93, 0, 0, ''),
(955, 'Hindalco Freshwrapp Aluminium Foil 9m', 'Hindalco\'s aluminium foil brand, Freshwrapp is considered as one of the leading brands of packaging foils in the country today. Freshwrapp kitchen foil is available from 10.5 micron upwards, while Freshpakk semi-rigid containers are available in a wide range of sizes and shapes.', 'hindalco_freshwapp_aluminium_foil.jpg', 62, 65, 0, 1, 71, '70', 0, 0, 1, 'NOS', 0, '0', 0, 3, 0, 0, 0, ''),
(956, 'Emami Fair And Handsome Fairness Cream For Men 30g (Free Face Wash Worth 38/-)', 'Emami Fair & Handsome No.1 Fairness Cream For Men has developed a breakthrough formulation for tough male skin. Powered by a unique Faircell technlogy, the cream works from within the skin cells, lightenning them and helping transform men\'s tough skin. It delivers % powerful benefits. *Sweat Absorption absorts sweat for long lasting, fresh look *Oil Control Reduces and Controls excess oil *Sun Protection protects against harmful UVA/UVB rays *Dark Spot Reduction reduces dark spots to give clearer skin *Visible Fairness visible fairness in 3 Weeks.', 'Editor_(4).jpg', 63, 72, 0, 1, 75, '75', 0, 0, 1, 'NOS', 0, '0', 0, 3, 30, 0, 0, ''),
(957, 'Garnier Men Power White Anti-pollution Face Wash 50g', 'Garnier Men Power White Double Action Face Wash is Garnier Men\'s first dual textured face wash. It helps remove dust and pollution from your face. It gives instant fairness and reduces dullness. All-day radiant and fresh-looking skin .\r\n', 'garnier_men_power_white_face_wash.jpg', 63, 72, 0, 1, 99, '98', 0, 0, 1, 'NOS', 0, '0', 0, 3, 50, 0, 0, ''),
(958, 'Del Monte Eggless Mayo Pouch 900g', 'Del Monte Mayo is made with carefully selected quality ingredients, which gives it a smooth and thick texture coupled with rich and creamy taste. The Eggless Mayonnaise is creamy and tasty without any flavor of egg and adds a delicious taste to the food.\r\n', 'del_monte_eggless_mayo_900g.jpg', 60, 54, 0, 1, 180, '178', 0, 0, 1, 'NOS', 0, '0', 0, 3, 900, 0, 0, ''),
(959, 'Dr. Oetker Funfoods Spread Cucumber & Carrot Eggless 300g', '* Dr. Oetker Fun Foods Spread CucumbCarrotEL is 100 percent Veg. * Easily spreadable * Trans Fat Free * Creamy and juicy with crunchy bits of cucumber and carrots * Create world famous sandwiches like veggie wrap, chip butty sandwich and many more	\r\n', 'FunFoods_Sandwich_Spread_300g1.jpg', 60, 55, 0, 1, 79, '78', 0, 0, 1, 'NOS', 0, '0', 0, 3, 300, 0, 0, ''),
(960, 'Wingreens Farms Schezwan Chilli Garlic Sauce 450g', 'Wingreens Farms Schezwan Chilli Garlic Sauce (450g) Sauce (450 g) A treat for spice lovers and perfect for those who love extra heat and flavour in their Chinese food! Red Chillies (49%), Garlic (12%), Sugar, Water, Iodized Salt, Acidity Regulators (INS260 & INS330), Thickener (INS415) and Mixed Spices.\r\n', 'wingreens_schezwan_chilli_garlic_sauce_450g.jpg', 60, 54, 0, 1, 149, '145', 0, 0, 1, 'NOS', 0, '0', 0, 6, 450, 0, 0, ''),
(961, 'Wingreens Farms Pizza & Pasta Sauce 450g', 'A delicious and versatile sauce that provides you with the perfect balance between the freshest ingredients from our farms, and a delicious tomato base. Use as a pasta sauce, a pizza spread, a marinade, or just to liven up vegetables & sandwiches.\r\n', 'wingreens_pizza_pasta_sauce_450g.jpg', 60, 54, 0, 1, 149, '145', 0, 0, 1, 'NOS', 0, '0', 0, 6, 450, 0, 0, ''),
(962, 'Cycle Brand Navin Sambrani 12 cups', 'One of the best gifts of nature, Sambrani has a distinct, peaceful and balsamic fragrance. When burnt on a charcoal piece, it emits an amazingly positive, vibrant and alluring aroma that cleanses the air and energy in the surroundings.\r\n', 'navin_sambrari.jpg', 57, 86, 0, 1, 72, '71', 0, 0, 1, 'NOS', 0, '0', 0, 3, 0, 0, 0, ''),
(963, 'Colgate Max Fresh Cooling Crystals Blue Toothpaste 150g+150g (Mega Save 20/-)', 'Experience a new dimension of freshness with Colgate® Max Fresh Cooling Crystals Toothpaste. It fights cavities and helps whiten teeth while refreshing and cleaning your whole mouth.\r\n', 'colgate-maxfresh-blue-saverpack-300-gm.jpeg', 63, 67, 0, 1, 164, '162', 0, 0, 1, 'NOS', 0, '0', 0, 6, 300, 0, 0, ''),
(964, 'Colgate Max Fresh Cooling Crystals Red Gel Toothpaste 150g+150g Pack Of 2 (Mega Save 20/-)', 'Experience a new dimension of freshness with Colgate® Max Fresh Cooling Crystals Toothpaste. It fights cavities and helps whiten teeth while refreshing and cleaning your whole mouth.\r\n', 'colgate-max-fresh-spicy-fresh-red-gel-toothpaste-150-g-pack-of-2.jpeg', 63, 67, 0, 1, 164, '162', 0, 0, 1, 'NOS', 0, '0', 0, 6, 300, 0, 0, ''),
(965, 'Lux International Creamy Perfection 125g', 'Want to feel radiant every day? Start every day with the fine fragrance of LUX International Creamy Perfection beauty bar. This luxurious body soap combines the soft, feminine scent of white florals with a luscious, creamy formula to pamper your senses and care for your skin. Enriched with Swiss moisturizers, feel the difference when you lather up in the shower and reveal delicately perfumed and radiant skin worthy of a star. Crafted for women who want to feel beautiful every day, the precious essence of white flowers has been transformed into a sophisticated fragrance by the world\'s top perfumers. The subtle scent of LUX International Creamy Perfection beauty bar lightly lingers on your skin, making it the perfect perfume for any occasion, morning or night. For maximum enjoyment, turn every bath into an exquisite pampering session. As you lather up, lush bubbles soap up decadently and gently cleanse your skin to leave it silky soft, smooth and irresistibly perfumed. LUX International Creamy Perfection beauty bar is the perfumed soap bar that brings out your extraordinary every day, with every shower.\r\n\r\n', 'lux-international-creamy-perfection-125g.jpg', 63, 68, 0, 1, 55, '55', 0, 0, 1, 'NOS', 0, '0', 0, 6, 125, 0, 0, ''),
(966, 'Whisper Choice Sanitary napkins Regular With Wings 20 Pads', 'Whisper choice sanitary pads helps you get up to 100 percent stain protection. This revolutionary pad has wings which keep the pad in place. Don\'t worry about stains and be unstoppable. Kadam badhaye jaa.\r\n', 'Whisper-Choice-Regular-With-Wings_20_pads.jpg', 63, 73, 0, 1, 85, '84', 0, 0, 1, 'NOS', 0, '0', 0, 3, 0, 0, 0, ''),
(968, 'Whisper Ultra Clean Sanitary Pads XL+ 7 Pads', 'Whisper Ultra Clean pads\' absorb liquid in seconds, their Dri-Weave cover provides soft, dry protection. Whisper Ultra Clean has you covered, so you can get on with the things you love without having to worry about your protection.\r\n', 'whisper_ultra_clean_XL+_7_pads.jpg', 63, 73, 0, 1, 80, '79', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(969, 'Hershey\'s Chocolate Flavored Syrup 623g', 'A deep rich caramel flavour in a velvety smooth syrup adds the perfect twist to every sweet dish.\r\n', 'Hersheys_syrup.jpg', 60, 54, 0, 1, 200, '180', 0, 0, 1, 'NOS', 0, '0', 0, 0, 623, 0, 0, ''),
(970, 'Whisper Choice Ultra Sanitary Pads XL with Wings', 'Whisper choice ultra sanitary pads helps you get up to 100 percent stain protection. This revolutionary pad has wings which keep the pad in place. Don\'t worry about stains and be unstoppable. Kadam badhaye jaa.	\r\n', 'whisper_choice_ultra1.jpg', 63, 73, 0, 1, 42, '41', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
(971, 'Kanaiya Brand Super Fine Mamra / Puffed Rice 400g', 'uffed rice is a cereal usually made by heating rice kernels under high pressure in the presence of steam, to form puffed grains. There are other methods of manufacturing too. Puffed rice is used in various breakfast cereals as well as snacks.', 'super_fine_marmra.jpg', 56, 30, 0, 1, 35, '35', 0, 0, 1, 'NOS', 0, '0', 0, 3, 400, 0, 0, ''),
(972, 'Whisper Choice Aloe Vera Freshness Sanitary Pads Regular With Wings 7 Pads', 'It’s about waking up happy. It’s about loving life and loving yourself as much as you do others. It’s about continuing to be unstoppable and feeling great at any age. It’s about being confident every day of the month. This revolutionary Whisper Ultra Overnight Sanitary Pads XL Wings specially designed for Overnight usage with Longer length* and Wide back for protection against back leaks which LASTS ALL NIGHT LONG.Kadam Badhaye Jaa', 'whisper_choice_aloe_cottony_soft.jpg', 63, 73, 0, 1, 28, '27', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(973, 'Whisper Ultra Soft Sanitary Pads XL+ 30 pads', 'Feel comfortable with whisper ultra soft sanitary pads with wings. For extra gentleness on your skin, whisper ultra soft pads are two times softer** and contain a soft top sheet in both the centre and wings. With whisper ultra soft pads, your skin will get all the care it needs and you’ll get all the confidence you deserve. These pads are nearly 40% longer* and have soft pores that drive liquid to the core and lock it away, so you have extra coverage and long-lasting protection. The stretchable wings in whisper ultra soft pads wrap around your panties to keep the pad in place, while the fresh odourless pearls capture and lock away period odour.', 'whisper_ultra_soft.jpg', 63, 73, 0, 1, 298, '297', 0, 0, 1, 'NOS', 0, '0', 0, 2, 0, 0, 0, ''),
(974, 'Sabena Dishwash Powder 500g', 'Sabena Dishwash Powder is the effective cleaner and remover of tough stains from your utensils. Its ingredients act to make your utensils free from grease and dirt and give you a fresh fragrance while taking care to keep your hands soft.', 'Sabena-Powder.jpg', 62, 63, 0, 1, 13, '12', 0, 0, 1, 'NOS', 0, '0', 0, 5, 500, 0, 0, ''),
(975, 'Axe Shaving Cream Denim For Sensitive Skin Buy 2 Get 1 Free', 'The spicy rich masculine scent with bursts of fresh citrus leave your skin soft and moisturised. Axe Denim Shaving Cream is rich, creamy lather enriched with moisturisers tames the toughest stubble, leaving your skin irresistible to the touch. It’s enriched with citrusy swirls for a spicy masculine scent.', 'Axe-Signature-Denim-Shaving-Cream-Buy-2-Get-1-Free.jpg', 63, 72, 0, 1, 136, '136', 0, 0, 1, 'NOS', 0, '0', 0, 4, 234, 0, 0, ''),
(976, 'Kelloggs Museli With 20% Almond And Raisin Nuts Delight 750g', 'Kellogg\'s Muesli Crunchy Fruit and Nut is a tasty and nourishing breakfast cereal made with five nutritious grains (wheat, corn, rice, barley and oats) and five delicious inclusions (almonds, raisins and candied fruits - papaya, apple, peach).', 'kelloggs_museli.jpg', 60, 53, 0, 1, 415, '410', 0, 0, 1, 'NOS', 0, '0', 0, 4, 750, 0, 0, ''),
(977, 'Gillette Presto Ready Shaver Buy 3 Get 1 Free', 'The Gillette Presto Razor is a man’s best friend on those days when he has to get to work in a jiffy yet sport that smart look. Also, these Presto Razor blades have been fashioned to glide across the face with less tug and pull. Besides minimizing skin irritation, this Presto Razor provides smooth comfortable shave. ', 'GILLETTE-PRESTO.jpg', 63, 72, 0, 1, 60, '60', 0, 0, 1, 'NOS', 0, '0', 0, 6, 0, 0, 0, ''),
(978, 'Origami So Soft Table Napkins Tissues 100N', 'Origami presents multipurpose napkins. They are assured to be hygienic and absorbent making it effective in coping with spills and splashes. These products are convenient to dispose and are of high quality, making it a must-have for all your parties, outings as well as your home and office needs.\r\n', 'origami_so_soft_table_napkins.jpg', 62, 65, 0, 1, 60, '50', 0, 0, 1, 'NOS', 0, '0', 0, 3, 0, 0, 0, ''),
(979, 'Origami Kitchen Towels 2 In 1 Money Saver Pack (60N x 2 Rolls)', 'Origami helps keep your kitchen neat and clean with this unique range of kitchen towels. They are highly absorbent and help to clean wet surfaces easily. These towels are dispenser friendly, convenient, tough and have clear perforation.\r\n', 'Origami-Kitchen-Towels.jpg', 62, 65, 0, 1, 140, '130', 0, 0, 1, 'NOS', 0, '0', 0, 3, 0, 0, 0, ''),
(980, 'GI Premium Rice Flour 1Kg', 'Rice flour, also called rice powder, is a form of flour made from finely milled rice. ... Production of this flour may include both white or brown rice grains and it can be used for all kinds of baked goods. Rice flour and rice starch are two different things.', 'corn_flour2.jpg', 56, 29, 0, 1, 45, '30', 0, 0, 1, 'NOS', 0, '0', 0, 3, 1, 0, 0, ''),
(981, 'GI Premium Rice Flour 500g', 'Rice flour, also called rice powder, is a form of flour made from finely milled rice. ... Production of this flour may include both white or brown rice grains and it can be used for all kinds of baked goods. Rice flour and rice starch are two different things.', 'corn_flour3.jpg', 56, 29, 0, 1, 25, '17', 0, 0, 1, 'NOS', 0, '0', 0, 4, 500, 0, 0, ''),
(982, 'Pringles Original Potato Chips', 'Pringles original flavoured potato chips offer a burst of flavour in every bite with none of the guilt. That is because they have 50 percent fewer calories than regular crisps since they are made with olestra. The pringles potato chips are ideal for snacks or lunch.\r\n', 'pringles_original.jpg', 61, 88, 0, 1, 99, '98', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(983, 'Pringles Desi Masala Tadka Potato Chips', 'Pringles Desi masala tadka is first ever local / desi flavour from brand Pringles. It\'s the flavour that brings an outdoorsy vibe to any gathering, whether you\'re at home, picnicking or road tripping.\r\n', 'pringles_masala_tadka.jpg', 61, 88, 0, 1, 99, '98', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(984, 'Pringles Pizza Potato Chips', 'Dried Potato, Edible Vegetable Oil, Corn Flour, Wheat Starch, Pizza Flavour Seasoning, Yeast Extract, Acidity Regulators, Flavour Enhancer, Anticaking Agent, Maltodextrin.\r\n', 'pringles_pizza.jpg', 61, 88, 0, 1, 99, '98', 0, 0, 1, 'NOS', 0, '0', 0, 4, 0, 0, 0, ''),
(987, 'Act II Classic Salted Popcorn 40g', 'Experience an all new rich taste with this ACT II Classic Salted popcorn that will be a great choice for your snack time. This pack is easy to make and is enjoyed and loved by all. It is enriched with the goodness of 100 percent whole grain which in turn ensures zero trans fat which makes it even more desirable for all. It is sure to be a great choice for every household with its ultimate lip smacking taste that will linger on your lips for a long time.', 'act_2_popcorn_classic_salted.jpg', 61, 88, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '0', 0, 15, 40, 0, 0, ''),
(988, 'Act II Magic Butter Popcorn 40g', 'Act II Magic Butter (Pressure Cooker) Popcorn is ready to cook buttery nosh that gets ready in just 3 minutes. Enjoy this light and tasty snack in leisure time with your family and friends.\r\n', 'act_2_popcorn_magic_butter_flavour.jpg', 61, 88, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '0', 0, 15, 40, 0, 0, ''),
(989, 'Ambica Mahalakshmi Dhoop Sticks 44g', 'Ambica Dhoop Sticks are an exotic and mystical fragrance, these dhoop sticks are a great addition to your pooja essentials. They are of premium quality, made with great care and are available in a variety of uplifting fragrances.\r\n', 'ambica_mahalakshmi_dhoops.jpg', 57, 86, 0, 1, 17, '17', 0, 0, 1, 'NOS', 0, '0', 0, 12, 44, 0, 0, ''),
(990, 'Snickers Chocolate Bar 45g', 'Snickers bar, packed with delicious and nutritious roasted peanuts, also contains nougat and caramel, creating a flavor that\'s enough to rock your taste buds, while busting hunger pangs between meals.\r\n', 'snickers-chocolate-50g-x-1-pc.jpg', 61, 61, 0, 1, 40, '40', 0, 0, 1, 'NOS', 0, '0', 0, 24, 45, 0, 0, ''),
(992, 'Act II Golden Sizzle Popcorn 40g', 'Leisure time with a bowl full of Act II Golden Sizzle Popcorn adds masala magic to the situation. The Ingredients of Act II Golden Sizzle Popcorn is Popping corn, edible oil, iodated salt, permitted anti caking agent. Act II Golden Sizzle Popcorn, when popped gives the crispy snacks with a fresh aroma.\r\n', 'act_2_popcorn_golden_sizzle1.png', 61, 88, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '0', 0, 15, 40, 0, 0, ''),
(993, 'Act II Chilli Surprise Popcorn 40g', 'Act II Chilli Surprise Popcorn has wholesome goodness of 100% whole grain popcorn mixed indigenously with little chilli flakes. To bring something new to the snacks variety, the Act II Chili Surprise Popcorn is one variation.\r\n', 'act_2_popcorn_chilli_surprise_flavour2.jpg', 61, 88, 0, 1, 10, '10', 0, 0, 1, 'NOS', 0, '0', 0, 15, 40, 0, 0, '');
